(window.webpackJsonpdarktionary=window.webpackJsonpdarktionary||[]).push([[19],{33:function(e){e.exports=JSON.parse('{"quickbeam":"See Quicken tree.","quaketail":"A wagtail.","quintile":"The aspect of planets when separated the fifth part of the zodiac, or 72\xba. Hutton.","queller":"1. A killer; as, Jack the Giant Queller. [Obs.] Wyclif (Mark vi. 27). 2. One who quells; one who overpowers or subdues.","queendom":"The dominion, condition, or character of a queen. Mrs. Browning.","quinquesyllable":"A word of five syllables.","quiver":"Nimble; active. [Obs.] \\" A little quiver fellow.\\" Shak.\\n\\nTo shake or move with slight and tremulous motion; to tremble; to quake; to shudder; to shiver. The green leaves quiver with the cooling wind. Shak. And left the limbs still quivering on the ground. Addison.\\n\\nThe act or state of quivering; a tremor.\\n\\nA case or sheath for arrows to be carried on the person. Reside him hung his bow And quiver, with three-bolted thunder stored. Milton.","quadrillion":"According to the French notation, which is followed also upon the Continent and in the United States, a unit with fifteen ciphers annexed; according to the English notation, the number produced by involving a million to the fourth power, or the number represented by a unit with twenty-four ciphers annexed. See the Note under Numeration.","quinazol":"A complex nitrogenous base related to cinnoline. [Written also chinazol.]","quakiness":"The state of being quaky; liability to quake.","quintette":"A composition for five voices or instruments; also, the set of five persons who sing or play five-part music.","quadruped":"Having four feet.\\n\\nAn animal having four feet, as most mammals and reptiles; -- often restricted to the mammals.","querent":"A complainant; a plaintiff.\\n\\nAn inquirer. [Obs.] Aubrey.","quadrilateralness":"The property of being quadrilateral.","quayd":"p. p. of Quail. [Obs.] Spenser.","quininic":"Pertaining to, or designating, a nitrogenous acid obtained as a yellow crystalline substance by the oxidation of quinine.","quadroxide":"A tetroxide. [R.]","quietus":"Final discharge or acquittance, as from debt or obligation; that which silences claims; (Fig.) rest; death. When he himself might his quietus make With a bare bodkin. Shak.","questionable":"1. Admitting of being questioned; inviting, or seeming to invite, inquiry. [R.] Thou com\'st in such a questionable shape That I will speak to thee. Shak. 2. Liable to question; subject to be doubted or called in question; problematical; doubtful; suspicious. It is questionable whether Galen ever saw the dissection of a human body.T. Baker. Syn. -- Disputable; debatable; uncertain; doubtful; problematical; suspicious.","questionist":"1. A questioner; an inquirer. [Obs.] 2. (Eng. Univ.)  A candidate for honors or degrees who is near the time of his examination.","quadrature":"1. (Math.)  The act of squaring; the finding of a square having the same area as some given curvilinear figure; as, the quadrature of a circle; the operation of finding an expression for the area of a figure bounded wholly or in part by a curved line, as by a curve, two ordinates, and the axis of abscissas. 2. A quadrate; a square. Milton. 3. (Integral Calculus)  The integral used in obtaining the area bounded by a curve; hence, the definite integral of the product of any function of one variable into the differential of that variable. 4. (Astron.)  The position of one heavenly body in respect to another when distant from it 90\xba, or a quarter of a circle, as the moon when at an equal distance from the points of conjunction and opposition. Quadrature of the moon (Astron.), the position of the moon when one half of the disk is illuminated. -- Quadrature of an orbit (Astron.), a point in an orbit which is at either extremity of the latus rectum drawn through the empty focus of the orbit.","quieter":"One who, or that which, quiets.","questionless":"Unquestioning; incurious. [R.]\\n\\nBeyond a question or doubt; doubtless; certainly.[R.] South. What it was in the apostles\' time, that, questionless, it must be still. Milton.","quadricipital":"Of or pertaining to the quadriceps.","quannet":"A flat file having the handle at one side, so as to be used like a plane.","questant":"One who undertakes a quest; a seeker. [Obs.] Shak.","quantify":"To modify or qualify with respect to quantity; to fix or express the quantity of; to rate.","questionably":"In a questionable manner.","qualmish":"Sick at the stomach; affected with nausea or sickly languor; inclined to vomit. Shak. -- Qualm\\"ish*ly, adv. -- Qualm\\"ish*ness, n.","quinologist":"One who is versed in quinology.","quercitin":"A yellow crystalline substance, occurring quite widely distributed in the vegetable kingdom, as is apple-tree bark, horse- chestnut leaves, etc., but originally obtained by the decomposition of quercitrin. Called also meletin.","quintroon":"The off-spring of an octoroon and a white person.","quinquedentate":"Five-toothed; as, a quinquedentate leaf.","quarto":"Having four leaves to the sheet; of the form or size of a quarto.\\n\\nOriginally, a book of the size of the fourth of sheet of printing paper; a size leaves; in present usage, a book of a square or nearly square form, and usually of large size.","quadrangle":"1. (Geom.)  A plane figure having four angles, and consequently four sides; any figure having four angles. 2. A square or quadrangular space or inclosure, such a space or court surrounded by buildings, esp. such a court in a college or public school in England.","quarter-deck":"That part of the upper deck abaft the mainmast, including the poop deck when there is one. Note: The quarter-deck is reserved as a promenade for the officers and (in passenger vessels) for the cabin passengers.","quintine":"The embryonic sac of an ovule, sometimes regarded as an innermost fifth integument. Cf. Quartine, and Tercine.","quirite":"One of the Quirites.","quob":"To throb; to quiver. [Local & Vulgar]","quit":"Any one of numerous species of small passerine birds native of tropical America. See Banana quit, under Banana, and Guitguit.\\n\\nReleased from obligation, charge, penalty, etc.; free; clear; absolved; acquitted. Chaucer. The owner of the ox shall be quit. Ex. xxi. 28. Note: This word is sometimes used in the form quits, colloquially; as, to be quits with one, that is, to have made mutual satisfaction of demands with him; to be even with him; hence, as an exclamation: Quits! we are even, or on equal terms. \\"To cry quits with the commons in their complaints.\\" Fuller.\\n\\n1. To set at rest; to free, as from anything harmful or oppressive; to relieve; to clear; to liberate. [R.] To quit you of this fear, you have already looked Death in the face; what have you found so terrible in it Wake. 2. To release from obligation, accusation, penalty, or the like; to absolve; to acquit. There may no gold them quyte. Chaucer. God will relent, and quit thee all his debt. Milton. 3. To discharge, as an obligation or duty; to meet and satisfy, as a claim or debt; to make payment for or of; to requite; to repay. The blissful martyr quyte you your meed. Chaucer. Enkindle all the sparks of nature To quit this horrid act. Shak. Before that judge that quits each soul his hire. Fairfax. 4. To meet the claims upon, or expectations entertained of; to conduct; to acquit; -- used reflexively. Be strong, and quit yourselves like men. I Sam. iv. 9. Samson hath guit himself Like Samson. Milton. 5. To carry through; to go through to the end. [Obs.] Never worthy prince a day did quit With greater hazard and with more renown. Daniel. 6. To have done with; to cease from; to stop; hence, to depart from; to leave; to forsake; as, to quit work; to quit the place; to quit jesting. Such a superficial way of examining is to quit truth for appearance. Locke. To quit cost, to pay; to reimburse. -- To quit scores, to make even; to clear mutually from demands. Does not the earth quit scores with all the elements in the noble fruits that issue from it South. Syn. -- To leave; relinquish; resign; abandon; forsake; surrender; discharge; requite. -- Quit, Leave. Leave is a general term, signifying merely an act of departure; quit implies a going without intention of return, a final and absolute abandonment.\\n\\nTo away; to depart; to stop doing a thing; to cease.","quack grass":"See Quitch grass.","quinicine":"An uncrystallizable alkaloid obtained by the action of heat from quinine, with which it is isomeric.","quadrigenarious":"Consisting of four hundred.","quakeress":"A woman who is a member of the Society of Friends.","quenchless":"Incapable of being quenched; inextinguishable; as, quenchless fire or fury. \\"Once kindled, quenchless evermore.\\" Byron. Syn. -- Inextinguishable; unquenchable. -- Quench\\"less*ly, adv. -- Quench\\"less*ness, n.","quadruplex":"Fourfold; folded or doubled twice. Quadruplex system (Electric Telegraph), a system by which four messages, two in each direction, may be sent simultaneously over the wire.","qualify":"1. To make such as is required; to give added or requisite qualities to; to fit, as for a place, office, occupation, or character; to furnish with the knowledge, skill, or other accomplishment necessary for a purpose; to make capable, as of an employment or privilege; to supply with legal power or capacity. He had qualified himself for municipal office by taking the oaths to the sovereigns in possession. Macaulay. 2. To give individual quality to; to modulate; to vary; to regulate. It hath no larynx . . . to qualify the sound. Sir T. Browne. 3. To reduce from a general, undefined, or comprehensive form, to particular or restricted form; to modify; to limit; to restrict; to restrain; as, to qualify a statement, claim, or proposition. 4. Hence, to soften; to abate; to diminish; to assuage; to reduce the strength of, as liquors. I do not seek to quench your love\'s hot fire, But qualify the fire\'s extreme rage. Shak. 5. To soothe; to cure; -- said of persons. [Obs.] In short space he has them qualified. Spenser. Syn. -- To fit; equip; prepare; adapt; capacitate; enable; modify; soften; restrict; restrain; temper.\\n\\n1. To be or become qualified; to be fit, as for an office or employment. 2. To obtain legal power or capacity by taking the oath, or complying with the forms required, on assuming an office.","qualitied":"Furnished with qualities; endowed. [Obs.] \\"He was well qualitied.\\" Chapman.","quinible":"An interval of a fifth; also, a part sung with such intervals. [Obs.] \\"He sang . . . a loud quynyble.\\" Chaucer.","quitch grass":"A perennial grass (Agropyrum repens) having long running rootstalks, by which it spreads rapidly and pertinaciously, and so becomes a troublesome weed. Also called couch grass, quick grass, quick grass, twitch grass. See Illustration in Appendix.","quickening":"1. The act or process of making or of becoming quick. 2. (Physiol.)  The first motion of the fetus in the womb felt by the mother, occurring usually about the middle of the term of pregnancy. It has been popularly supposed to be due to the fetus becoming possessed of independent life.","quadrel":"1. A square piece of turf or peat. [Prov. Eng.] 2. A square brick, tile, or the like.","quick-witted":"Having ready wit Shak.","quiddity":"1. The essence, nature, or distinctive peculiarity, of a thing; that which answers the question, Quid est or, What is it \\" The degree of nullity and quiddity.\\" Bacon. The quiddity or characteristic difference of poetry as distinguished from prose. De Quincey. 2. A trifling nicety; a cavil; a quibble. We laugh at the quiddities of those writers now. Coleridge.","quindecemvirate":"The body or office of the quindecemviri.","quilt":"Anything that is quilted; esp., a quilted bed cover, or a skirt worn by women; any cover or garment made by putting wool, cotton, etc., between two cloths and stitching them together; also, any outer bed cover. The beds were covered with magnificent quilts. Arbuthnot.\\n\\n1. To stitch or sew together at frequent intervals, in order to confine in place the several layers of cloth and wadding of which a garment, comforter, etc., may be made; as, to quilt a coat. Dryden. 2. To wad, as a garment, with warm soft material. 3. To stitch or sew in lines or patterns.","quadrivalve":"Dehiscent into four similar parts; four-valved; as, a quadrivalve pericarp.\\n\\nA door, shutter, or the like, having four folds.","quay":"A mole, bank, or wharf, formed toward the sea, or at the side of a harbor, river, or other navigable water, for convenience in loading and unloading vessels. [Written also key.]\\n\\nTo furnish with quays.","quinze":"A game at cards in which the object is to make fifteen points.","quadroon":"The offspring of a mulatto and a white person; a person quarter-blooded. [Written also quarteron, quarteroon, and quateron.]","quartene":"Same as Butylene.","quaff":"To drink with relish; to drink copiously of; to swallow in large draughts. \\"Quaffed off the muscadel.\\" Shak. They eat, they drink, and in communion sweet Quaff immortality and joy. Milton.\\n\\nTo drink largely or luxuriously. Twelve days the gods their solemn revels keep, And quaff with blameless Ethiops in the deep. Dryden.","quakerish":"Like or pertaining to a Quaker; Quakerlike.","quacha":"The quagga.","quaternate":"Composed of, or arranged in, sets of four; quaternary; as, quaternate leaves.","quicksilver":"The metal mercury; -- so called from its resemblance to liquid silver. Quicksilver horizon, a mercurial artificial horizon. See under Horizon. -- Quicksilver water, a solution of mercury nitrate used in artificial silvering; quick water.","quintuple":"Multiplied by five; increased to five times the amount; fivefold. Quintuple time (Mus.), a time having five beats in a measure. It is seldom used.\\n\\nTo make fivefold, or five times as much or many.","quixotry":"Quixotism; visionary schemes.","quran":"See Koran.","quarterly":"1. Containing, or consisting of, a fourth part; as, quarterly seasons. 2. Recurring during, or at the end of, each quarter; as, quarterly payments of rent; a quarterly meeting.\\n\\nA periodical work published once a quarter, or four times in a year.\\n\\n1. By quarters; once in a quarter of a year; as, the returns are made quarterly. 2. (Her.)  In quarters, or quarterings; as, to bear arms quarterly; in four or more parts; -- said of a shield thus divided by lines drawn through it at right angles.","quashee":"A negro of the West Indies.","quackle":"To suffocate; to choke. [Prov. Eng.]","quab":"An unfledged bird; hence, something immature or unfinished. Ford.\\n\\nSee Quob, v. i.","quadrifid":"Divided, or deeply cleft, into four parts; as, a quadrifid perianth; a quadrifid leaf.","queerish":"Rather queer; somewhat singular.","quinovin":"An amorphous bitter glucoside derived from cinchona and other barks. Called also quinova bitter, and quinova. [Written also chinovin, and kinovin.]","quiveringly":"With quivering motion.","quinia":"Quinine.","quadruply":"To a fourfold quantity; so as to be, or cause to be, quadruple; as, to be quadruply recompensed.","quat":"(a) A pustule. [Obs.] (b) An annoying, worthless person. Shak.\\n\\nTo satiate; to satisfy. [Prov. Eng.]","quercite":"A white crystalline substance, C6H7(OH)5, found in acorns, the fruit of the oak (Quercus). It has a sweet taste, and is regarded as a pentacid alcohol.","queachy":"1. Yielding or trembling under the feet, as moist or boggy ground; shaking; moving. \\"The queachy fens.\\" \\"Godwin\'s queachy sands.\\" Drayton. 2. Like a queach; thick; bushy. [Obs.] Cockeram.","qualitative":"Relating to quality; having the character of quality. -- Qual\\"i*ta*tive*ly, adv. Qualitative analysis (Chem.), analysis which merely determines the constituents of a substance without any regard to the quantity of each ingredient; -- contrasted with quantitative analysis.","quantitive":"Estimable according to quantity; quantitative. Sir K. Digby.","quidditative":"Quiddative.","quindecagon":"A plane figure with fifteen angles, and consequently fifteen sides.","quadripartitely":"In four parts.","quiddit":"A subtilty; an equivocation. [Obs.] Shak. By some strange quiddit or some wrested clause. Drayton.","quinquedentated":"Five-toothed; as, a quinquedentate leaf.","quadruple":"Fourfold; as, to make quadruple restitution; a quadruple alliance. Quadruple time (Mus.), that in which each measure is divided into four equal parts.\\n\\nfour times the sum or number; a fourfold amount; as, to receive to quadruple of the amount in damages.\\n\\nTo multiply by four; to increase fourfold; to double; to double twice. A. Smith.\\n\\nTo be multiplied by four; to increase fourfold; to become four times as much.","quell":"1. To die. [Obs.] Yet he did quake and quaver, like to quell. Spenser. 2. To be subdued or abated; to yield; to abate. [R.] Winter\'s wrath begins to quell. Spenser.\\n\\n1. To take the life of; to kill. [Obs.] Spenser. The ducks cried as [if] men would them quelle. Chaucer. 2. To overpower; to subdue; to put down. The nation obeyed the call, rallied round the sovereign, and enabled him to quell the disaffected minority. Macaulay. Northward marching to quell the sudden revolt. Longfellow. 3. To quiet; to allay; to pacify; to cause to yield or cease; as, to quell grief; to quell the tumult of the soul. Much did his words the gentle lady quell. Spenser. Syn. -- to subdue; crush; overpower; reduce; put down; repress; suppress; quiet; allay; calm; pacify.\\n\\nMurder. [Obs.] Shak.","quarteron":"A quarter; esp., a quarter of a pound, or a quarter of a hundred. Piers Plowman.\\n\\nA quadroon.","quinquereme":"A galley having five benches or banks of oars; as, an Athenian quinquereme.","quirister":"A chorister. See Chorister. [R.] Thomson.","quiddler":"One who wastes his energy about trifles. Emerson.","quadrilocular":"Having four cells, or cavities; as, a quadrilocular heart.","quantitative":"Relating to quantity. -- Quan\\"ti*ta*tive*ly, adv. Quantitative analysis (Chem.), analysis which determines the amount or quantity of each ingredient of a substance, by weight or by volume; -- contrasted with qualitative analysis.","quelquechose":"A trifle; a kickshaw. Donne.","quitture":"A discharge; an issue. [Obs.] To cleanse the quitture from thy wound. Chapman.","quoil":"See Coil. [Obs.]","question":"1. The act of asking; interrogation; inquiry; as, to examine by question and answer. 2. Discussion; debate; hence, objection; dispute; doubt; as, the story is true beyond question; he obeyed without question. There arose a question between some of John\'s disciples and the Jews about purifying. John iii. 25. It is to be to question, whether it be lawful for Christian princes to make an invasive war simply for the propagation of the faith. Bacon. 3. Examination with reference to a decisive result; investigation; specifically, a judicial or official investigation; also, examination under torture. Blackstone. He that was in question for the robbery. Shak. The Scottish privy council had power to put state prisoners to the question. Macaulay. 4. That which is asked; inquiry; interrogatory; query. But this question asked Puts me in doubt. Lives there who loves his pain Milton. 5. Hence, a subject of investigation, examination, or debate; theme of inquiry; matter to be inquired into; as, a delicate or doubtful question. 6. Talk; conversation; speech; speech.[Obs.] Shak. In question, in debate; in the course of examination or discussion; as, the matter or point in question. -- Leading question. See under Leading. -- Out of question, unquestionably. \\"Out of question, \'t is Maria\'s hand.\\" Shak. -- Out of the question. See under Out. -- Past question, beyond question; certainly; undoubtedly; unquestionably. -- Previous question, a question put to a parliamentary assembly upon the motion of a member, in order to ascertain whether it is the will of the body to vote at once, without further debate, on the subject under consideration. Note: The form of the question is: \\"Shall the main question be now put\\" If the vote is in the affirmative, the matter before the body must be voted upon as it then stands, without further general debate or the submission of new amendments. In the House of Representatives of the United States, and generally in America, a negative decision operates to keep the business before the body as if the motion had not been made; but in the English Parliament, it operates to postpone consideration for the day, and until the subject may be again introduced. In American practice, the object of the motion is to hasten action, and it is made by a friend of the measure. In English practice, the object is to get rid of the subject for the time being, and the motion is made with a purpose of voting against it. Cushing. -- To beg the question. See under Beg. -- To the question, to the point in dispute; to the real matter under debate. Syn. -- Point; topic; subject.\\n\\n1. To ask questions; to inquire. He that questioneth much shall lean much. Bacon. 2. To argue; to converse; to dispute. [Obs.] I pray you, think you question with the Jew. Shak.\\n\\n1. To inquire of by asking questions; to examine by interrogatories; as, to question a witness. 2. To doubt of; to be uncertain of; to query. And most we question what we most desire. Prior. 3. To raise a question about; to call in question; to make objection to. \\"But have power and right to question thy bold entrance on this place.\\" Milton. 4. To talk to; to converse with. With many holiday and lady terms he questioned me. Shak. Syn. -- To ask; interrogate; catechise; doubt; controvert; dispute. -- Question, Inquire, Interrogate. To inquire is merely to ask for information, and implies no authority in the one who asks. To interrogate is to put repeated questions in a formal or systematic fashion to elicit some particular fact or facts. To question has a wider sense than to interrogate, and often implies an attitude of distrust or opposition on the part of the questioner.","quackism":"Quackery. Carlyle.","quaquaversal":"1. Turning or dipping in any or every direction. 2. (Geol.)  Dipping toward all points of the compass round a center, as beds of lava round a crater.","quidam":"Somebody; one unknown. Spenser.","quinquina":"Peruvian bark.","quickwork":"(a) All the submerged section of a vessel\'s planking. (b) The planking between the spirketing and the clamps. (c) The short planks between the portholes.","quatorzain":"A poem of fourteen lines; a sonnet. R. H. Stoddard.","quassia":"The wood of several tropical American trees of the order Simarube\xe6, as Quassia amara, Picr\xe6na excelsa, and Simaruba amara. It is intensely bitter, and is used in medicine and sometimes as a substitute for hops in making beer.","quilter":"One who, or that which, quilts.","quirites":"Roman citizens. Note: After the Sabines and Romans had united themselves into one community, under Romulus, the name of Quirites was taken in addition to that of Romani, the Romans calling themselves in a civil capacity Quirites, while in a political and military capacity they retained the name of Romani. Andrews.","quicksilvering":"The mercury and foil on the back of a looking-glass.","quilled":"Furnished with quills; also, shaped like quills. \\"A sharp- quilled porcupine.\\" Shak. Quilled suture (Surg.), a variety of stitch in which the threads after being passed deeply through the edges of a wound are secured about two quills or bodies of similar shape, in order to produce a suitable degree of pressure.","querpo":"The inner or body garments taken together. See Cuerpo. Dryden.","quirk":"1. A sudden turn; a starting from the point or line; hence, an artful evasion or subterfuge; a shift; a quibble; as, the quirks of a pettifogger. \\"Some quirk or . . . evasion.\\" Spenser. We ground the justification of our nonconformity on dark subtilties and intricate quirks. Barrow. 2. A fit or turn; a short paroxysm; a caprice. [Obs.] \\"Quirks of joy and grief.\\" Shak. 3. A smart retort; a quibble; a shallow conceit. Some odd quirks and remnants of wit. Shak. 4. An irregular air; as, light quirks of music. Pope. 5. (Building)  A piece of ground taken out of any regular ground plot or floor, so as to make a court, yard, etc.; -- sometimes written quink. Gwilt. 6. (Arch.)  A small channel, deeply recessed in proportion to its width, used to insulate and give relief to a convex rounded molding. Quirk molding, a bead between two quirks.","quadrivial":"Having four ways meeting in a point. B. Jonson.\\n\\nOne of the four \\"liberal arts\\" making up the quadrivium.","quantic":"A homogeneous algebraic function of two or more variables, in general containing only positive integral powers of the variables, and called quadric, cubic, quartic, etc., according as it is of the second, third, fourth, fifth, or a higher degree. These are further called binary, ternary, quaternary, etc., according as they contain two, three, four, or more variables; thus, the quantic is a binary cubic.","quartane":"Butane, each molecule of which has four carbon atoms.","quartile":"Same as Quadrate.","quo warranto":"A writ brought before a proper tribunal, to inquire by what warrant a person or a corporation acts, or exercises certain powers. Blackstone. Note: An information in the nature of a quo warranto is now common as a substitute for the writ. Wharton.","quartenylic":"Pertaining to, or designating, an acid of the acrylic acid series, metameric with crotonic acid, and obtained as a colorless liquid; -- so called from having four carbon atoms in the molecule. Called also isocrotonic acid.","quipu":"A contrivance employed by the ancient Peruvians, Mexicans, etc., as a substitute for writing and figures, consisting of a main cord, from which hung at certain distances smaller cords of various colors, each having a special meaning, as silver, gold, corn, soldiers. etc. Single, double, and triple knots were tied in the smaller cords, representing definite numbers. It was chiefly used for arithmetical purposes, and to register important facts and events. [Written also quipo.] Tylor. The mysterious science of the quipus . . . supplied the Peruvians with the means of communicating their ideas to one another, and of transmitting them to future generations. Prescott.","quintessential":"Of the nature of a quintessence; purest. \\"Quintessential extract of mediocrity.\\" G. Eliot.","quinoa":"The seeds of a kind of goosewort (Chenopodium Quinoa), used in Chili and Peru for making porridge or cakes; also, food thus made.","quicksand":"Sand easily moved or readily yielding to pressure; especially, a deep mass of loose or moving sand mixed with water, sometimes found at the mouth of a river or along some coasts, and very dangerous, from the difficulty of extricating a person who begins sinking into it. Life hath quicksands, -- Life hath snares! Longfellow.","quey":"A heifer. [Scot.]","quarl":"A medusa, or jellyfish. [R.] The jellied quarl that flings At once a thousand streaming stings. J. R. Drake.","quiescently":"In a quiescent manner.","quice":"See Queest.","quartern":"1. A quarter. Specifically: (a) The fourth part of a pint; a gill. (b) The fourth part of a peck, or of a stone (14 ibs.). 2. A loaf of bread weighing about four pounds; -- called also quartern loaf. Simmonds.","quadrinomial":"A polynomial of four terms connected by the signs plus or minus.","quadrumanous":"Having four hands; of or pertaining to the Quadrumana.","quadrantal":"Of or pertaining to a quadrant; also, included in the fourth part of a circle; as, quadrantal space. Quadrantal triangle, a spherical triangle having one side equal to a quadrant or arc of 90\xba. -- Quadrantal versor, a versor that expresses rotation through one right angle.\\n\\n1. (Rom. Antiq.)  A cubical vessel containing a Roman cubic foot, each side being a Roman square foot; -- used as a measure. 2. A cube. [R.]","quean":"1. A woman; a young or unmarried woman; a girl. [Obs. or Scot.] Chaucer. 2. A low woman; a wench; a slut. \\"The dread of every scolding quean.\\" Gay.","qua":"In so far as; in the capacity or character of; as. It is with Shelley\'s biographers qua biographers that we have to deal. London Spectator.","quercitron":"1. The yellow inner bark of the Quercus tinctoria, the American black oak, yellow oak, dyer\'s oak, or quercitron oak, a large forest tree growing from Maine to eastern Texas. 2. Quercitrin, used as a pigment. See Quercitrin.","quickhatch":"The wolverine.","quadrivium":"The four \\"liberal arts,\\" arithmetic, music, geometry, and astronomy; -- so called by the schoolmen. See Trivium.","quadruplane":"An a\xebroplane with four superposed main supporting surfaces.","quadriphyllous":"Having four leaves; quadrifoliate.","quag":"A quagmire. [R.] \\"Crooked or straight, through quags or thorny dells.\\" Cowper.","quadridentate":"Having four teeth; as, a quadridentate leaf.","quaggy":"Of the nature of a quagmire; yielding or trembling under the foot, as soft, wet earth; spongy; boggy. \\"O\'er the watery strath, or quaggy moss.\\" Collins.","quaker":"1. One who quakes. 2. One of a religious sect founded by George Fox, of Leicestershire, England, about 1650, -- the members of which call themselves Friends. They were called Quakers, originally, in derision. See Friend, n., 4. Fox\'s teaching was primarily a preaching of repentance . . . The trembling among the listening crowd caused or confirmed the name of Quakers given to the body; men and women sometimes fell down and lay struggling as if for life. Encyc. Brit. 3. (Zo\xf6l.) (a) The nankeen bird. (b) The sooty albatross. (c) Any grasshopper or locust of the genus (Edipoda; -- so called from the quaking noise made during flight. Quaker buttons. (Bot.) See Nux vomica. -- Quaker gun, a dummy cannon made of wood or other material; -- so called because the sect of Friends, or Quakers, hold to the doctrine, of nonresistance. -- Quaker ladies (Bot.), a low American biennial plant (Houstonia c\xe6rulea), with pretty four-lobed corollas which are pale blue with a yellowish center; -- also called bluets, and little innocents.","quakerism":"The peculiar character, manners, tenets, etc., of the Quakers.","quack":"1. To utter a sound like the cry of a duck. 2. To make vain and loud pretensions; to boast. \\" To quack of universal cures.\\" Hudibras. 3. To act the part of a quack, or pretender.\\n\\n1. The cry of the duck, or a sound in imitation of it; a hoarse, quacking noise. Chaucer. 2. Etym: [Cf. Quacksalver.]  A boastful pretender to medical skill; an empiric; an ignorant practitioner. 3. Hence, one who boastfully pretends to skill or knowledge of any kind not possessed; a charlatan. Quacks political; quacks scientific, academical. Carlyle.\\n\\nPertaining to or characterized by, boasting and pretension; used by quacks; pretending to cure diseases; as, a quack medicine; a quack doctor.","quadratic":"1. Of or pertaining to a square, or to squares; resembling a quadrate, or square; square. 2. (Crystallog.)  Tetragonal. 3. (Alg.)  Pertaining to terms of the second degree; as, a quadratic equation, in which the highest power of the unknown quantity is a square.","quadrisyllabic":"Having four syllables; of or pertaining to quadrisyllables; as, a quadrisyllabic word.","qualificative":"That which qualifies, modifies, or restricts; a qualifying term or statement. How many qualificatives, correctives, and restrictives he inserteth in this relation. Fuller.","quantivalent":"Of or pertaining to quantivalence. [Archaic]","quar":"A quarry. [Prov. Eng.] B. Jonson.","quaily":"The upland plover. [Canadian]","quarte":"Same as 2d Carte.","quartermaster":"1. (Mil.)  An officer whose duty is to provide quarters, provisions, storage, clothing, fuel, stationery, and transportation for a regiment or other body of troops, and superintend the supplies. 2. (Naut.)  A petty officer who attends to the helm, binnacle, signals, and the like, under the direction of the master. Totten. Quartermaster general (Mil.), in the United States a staff officer, who has the rank of brigadier general and is the chief officer in the quartermaster\'s department; in England, an officer of high rank stationed at the War Office having similar duties; also, a staff officer, usually a general officer, accompanying each complete army in the field. -- Quartermaster sergeant. See Sergeant.","quatrefeuille":"Same as Quarterfoil.","quakery":"Quakerism. [Obs.] Hallywell.","quattrocento":"The fifteenth century, when applied to Italian art or literature; as, the sculpture of the quattrocento; quattrocento style. --Quat`tro*cen\\"tist (#), n.","quadrilobed":"Having four lobes; as, a quadrilobate leaf.","quaver":"1. To tremble; to vibrate; to shake. Sir I. Newton. 2. Especially, to shake the voice; to utter or form sound with rapid or tremulous vibrations, as in singing; also, to trill on a musical instrument\\n\\nTo utter with quavers. We shall hear her quavering them . . . to some sprightly airs of the opera. Addison.\\n\\n1. A shake, or rapid and tremulous vibration, of the voice, or of an instrument of music. 2. (Mus.)  An eighth note. See Eighth.","quickstep":"A lively, spirited march; also, a lively style of dancing.","quinary":"Consisting of five; arranged by fives. Boyle. Quinary system (Zo\xf6l.), a fanciful classification based on the hypothesis that each group contains five types.","quinnat":"The California salmon (Oncorhynchus choicha); -- called also chouicha, king salmon, chinnook salmon, and Sacramento salmon. It is of great commercial importance. [Written also quinnet.]","quinogen":"A hypothetical radical of quinine and related alkaloids.","quinque":"A combining form meaning five, five times, fivefold; as, quinquefid, five-cleft; quinquedentate, five-toothed.","quinque foliolate":"Having five leaflets. Gray.","quadricostate":"Having four ribs.","quahaug":"An American market clam (Venus mercenaria). It is sold in large quantities, and is highly valued as food. Called also round clam, and hard clam. Note: The name is also applied to other allied species, as Venus Mortoni of the Gulf of Mexico.","quinquelobared":"Cut less than halfway into portions, usually somewhat rounded; five-lobed; as, a quinquelobate leaf or corolla.","quinquennium":"Space of five years.","quintain":"An object to be tilted at; -- called also quintel. [Written also quintin.] Note: A common form in the Middle Ages was an upright post, on the top of which turned a crosspiece, having on one end a broad board, and on the other a sand bag. The endeavor was to strike the board with the lance while riding under, and get away without being hit by the sand bag. \\"But a quintain, a mere lifeless block.\\" Shak.","quip":"A smart, sarcastic turn or jest; a taunt; a severe retort; a gibe. Quips, and cranks, and wanton wiles. Milton. He was full of joke and jest, But all his merry quips are o\'er. Tennyson.\\n\\nTo taunt; to treat with quips. The more he laughs, and does her closely quip. Spenser.\\n\\nTo scoff; to use taunts. Sir H. Sidney.","quirboilly":"Leather softened by boiling so as to take any required shape. Upon drying, it becomes exceedingly hard, and hence was formerly used for armor. [Obs.] \\"His jambeux were of quyrboilly.\\" Chaucer.","quirpele":"The Indian ferret.","quodlibetarian":"One who discusses any subject at pleasure.","quod":"A quadrangle or court, as of a prison; hence, a prison. [Slang] \\"Flogged or whipped in quod.\\" T. Hughes.\\n\\nQuoth; said. See Quoth. [Obs.] \\"Let be,\\" quod he, \\"it shall not be.\\" Chaucer.","quateron":"See 2d Quarteron.","quota":"A proportional part or share; the share or proportion assigned to each in a division. \\"Quota of troops and money.\\" Motley.","quote":"1. To cite, as a passage from some author; to name, repeat, or adduce, as a passage from an author or speaker, by way of authority or illustration; as, to quote a passage from Homer. 2. To cite a passage from; to name as the authority for a statement or an opinion; as, to quote Shakespeare. 3. (Com.)  To name the current price of. 4. To notice; to observe; to examine. [Obs.] Shak. 5. To set down, as in writing. [Obs.] \\"He\'s quoted for a most perfidious slave.\\" Shak. Syn. -- To cite; name; adduce; repeat. Quote, Cite. To cite was originally to call into court as a witness, etc., and hence denotes bringing forward any thing or person as evidence. Quote usually signifies to reproduce another\'s words; it is also used to indicate an appeal to some one as an authority, without adducing his exact words.\\n\\nA note upon an author. [Obs.] Cotgrave.","quadratrix":"A curve made use of in the quadrature of other curves; as the quadratrix, of Dinostratus, or of Tschirnhausen.","quaestor":"Same as Questor.","quarteroon":"A quadroon.","quickness":"1. The condition or quality of being quick or living; life. [Obs.] Touch it with thy celestial quickness. Herbert. 2. Activity; briskness; especially, rapidity of motion; speed; celerity; as, quickness of wit. This deed . . . must send thee hence With fiery quickness. Shak. His mind had, indeed, great quickness and vigor. Macaulay. 3. Acuteness of perception; keen sensibility. Would not quickness of sensation be an inconvenience to an animal that must lie still Locke 4. Sharpness; pungency of taste. Mortimer. Syn. -- Velocity; celerity; rapidity; speed; haste; expedition; promptness; dispatch; swiftness; nimbleness; fleetness; agility; briskness; liveliness; readiness; sagacity; shrewdness; shrewdness; sharpness; keenness.","quadragenarious":"Consisting of forty; forty years old.","quaffer":"One who quaffs, or drinks largely.","quasi-public corporation":"A corporation, such as a railroad company, lighting company, water company, etc., organized or chartered to follow a public calling or to render services more or less essential to the general public convenience or safety.","quaich":"A small shallow cup or drinking vessel. [Scot.] [Written also quegh.]","questorship":"The office, or the term of office, of a questor.","quitly":"Quite. [Obs.] Chaucer.","quercitrin":"A glucoside extracted from the bark of the oak (Quercus) as a bitter citron-yellow crystalline substance, used as a pigment and called quercitron.","quinoline":"A nitrogenous base, C9H7N obtained as a pungent colorless liquid by the distillation of alkaloids, bones, coal tar, etc. It the nucleus of many organic bodies, especially of certain alkaloids and related substances; hence, by extension, any one of the series of alkaloidal bases of which quinoline proper is the type. [Written also chinoline.]","quintan":"Occurring as the fifth, after four others also, occurring every fifth day, reckoning inclusively; as, a quintan fever. -- n. (Med.)  An intermittent fever which returns every fifth day, reckoning inclusively, or in which the intermission lasts three days.","qualm":"1. Sickness; disease; pestilence; death. [Obs.] thousand slain and not of qualm ystorve [dead]. Chaucer. 2. A sudden attack of illness, faintness, or pain; an agony. \\" Qualms of heartsick agony.\\" Milton. 3. Especially, a sudden sensation of nausea. For who, without a qualm, hath ever looked On holy garbage, though by Homer cooked Roscommon. 4. A prick or scruple of conscience; uneasiness of conscience; compunction. Dryden.","quadrigeminous":"Fourfold; having four similar parts, or two pairs of similar parts. Quadrigeminal bodies (Anat.), two pairs of lobes, or elevations, on the dorsal side of the midbrain of most mammals; the optic lobes. The anterior pair are called the nates, and the posterior the testes.","quizzer":"One who quizzes; a quiz.","quas":"A kind of beer. Same as Quass.","quamoclit":"Formerly, a genus of plants including the cypress vine (Quamoclit vulgaris, now called Ipomoea Quamoclit). The genus is now merged in Ipomoea.","quartine":"A supposed fourth integument of an ovule, counting from the outside.","querimonious":"Complaining; querulous; apt to complain. -- Quer`i*mo\\"ni*ous*ly, adv. -- Quer`i*mo\\"ni*ous*ness, n.","quicklime":"Calcium oxide; unslacked lime; -- so called because when wet it develops great heat. See 4th Lime, 2.","query":"1. A question; an inquiry to be answered or solved. I shall conclude with proposing only some queries, in order to a . . . search to be made by others. Sir I. Newton. 2. A question in the mind; a doubt; as, I have a query about his sincerity. 3. An interrogation point [] as the sign of a question or a doubt.\\n\\n1. To ask questions; to make inquiry. Each prompt to query, answer, and debate. Pope. 2. To have a doubt; as, I query if he is right.\\n\\n1. To put questions about; to elicit by questioning; to inquire into; as, to query the items or the amount; to query the motive or the fact. 2. To address questions to; to examine by questions. 3. To doubt of; to regard with incredulity. 4. To write \\" query\\" (qu., qy., or ) against, as a doubtful spelling, or sense, in a proof. See Qu\xe6re.","qualifiedness":"The state of being qualified.","quarry-faced":"Having a face left as it comes from the quarry and not smoothed with the chisel or point; -- said of stones.","quatrain":"A stanza of four lines rhyming alternately. Dryden.","queencraft":"Craft or skill in policy on the part of a queen. Elizabeth showed much queencraft in procuring the votes of the nobility. Fuller.","qualification":"1. The act of qualifying, or the condition of being qualified. 2. That which qualifies; any natural endowment, or any acquirement, which fits a person for a place, office, or employment, or which enables him to sustian any character with success; an enabling quality or circumstance; requisite capacity or possession. There is no qualification for government but virtue and wisdom, actual or presumptive. Burke. 3. The act of limiting, or the state of being limited; that which qualifies by limiting; modification; restriction; hence, abatement; diminution; as, to use words without any qualification.","quint":"1. A set or sequence of five, as in piquet. 2. (Mus.)  The interval of a fifth.","quinquevalvular":"Having five valves, as a pericarp.","quantum":"1. Quantity; amount. \\"Without authenticating . . . the quantum of the charges.\\" Burke. 2. (Math.)  A definite portion of a manifoldness, limited by a mark or by a boundary. W. K. Clifford. Quantum meruit ( Etym: [L., as much as he merited] (Law), a count in an action grounded on a promise that the defendant would pay to the plaintiff for his service as much as he should deserve. -- Quantum sufficit (, or Quantum suff. Etym: [L., as much suffices] (Med.), a sufficient quantity. -- Quantum valebat ( Etym: [L., as much at it was worth] (Law), a count in an action to recover of the defendant, for goods sold, as much as they were worth. Blackstone.","quirkish":", Consisting of quirks; resembling a quirk. Barrow.","quarrel":"1. An arrow for a crossbow; -- so named because it commonly had a square head. [Obs.] To shoot with arrows and quarrel. Sir J. Mandeville. Two arblasts, . . . with windlaces and quarrels. Sir W. Scott. 2. (Arch.)  Any small square or quadrangular member; as: (a) A square of glass, esp. when set diagonally. (b) A small opening in window tracery, of which the cusps, etc., make the form nearly square. (c) A square or lozenge-shaped paving tile. 3. A glazier\'s diamond. Simmonds. 4. A four-sided cutting tool or chisel having a diamond-shaped end.\\n\\n1. A breach of concord, amity, or obligation; a falling out; a difference; a disagreement; an antagonism in opinion, feeling, or conduct; esp., an angry dispute, contest, or strife; a brawl; an altercation; as, he had a quarrel with his father about expenses. I will bring a sword upon you that shall avenge the quarrel of my covenant. Lev. xxvi. 25. On open seas their quarrels they debate. Dryden. 2. Ground of objection, dislike, difference, or hostility; cause of dispute or contest; occasion of altercation. Herodias had a quarrel against him, and would have killed him. Mark vi. 19. No man hath any quarrel to me. Shak. He thought he had a good quarrel to attack him. Holinshed. 3. Earnest desire or longing. [Obs.] Holland. To pick a quarrel. See under Pick, v. t. Syn. -- Brawl; broil; squabble; affray; feud; tumult; contest; dispute; altercation; contention; wrangle.\\n\\n1. To violate concord or agreement; to have a difference; to fall out; to be or become antagonistic. Our people quarrel with obedience. Shak. But some defect in her Did quarrel with the noblest grace she owed. Shak. 2. To dispute angrily, or violently; to wrangle; to scold; to altercate; to contend; to fight. Beasts called sociable quarrel in hunger and lust. Sir W. Temple. 3. To find fault; to cavil; as, to quarrel with one\'s lot. I will not quarrel with a slight mistake. Roscommon.\\n\\n1. To quarrel with. [R.] \\"I had quarelled my brother purposely.\\" B. Jonson. 2. To compel by a quarrel; as, to quarrel a man out of his estate or rights.\\n\\nOne who quarrels or wrangles; one who is quarrelsome. Shak.","quartic":"Of the fourth degree.\\n\\n(a) (Alg.) A quantic of the fourth degree. See Quantic. (b) (Geom.) A curve or surface whose equation is of the fourth degree in the variables.","quinizine":"any one of a series of nitrogenous bases, certain of which are used as antipyretics.","quadri-syllabical":"Having four syllables; of or pertaining to quadrisyllables; as, a quadrisyllabic word.","querulous":"1. Given to quarreling; quarrelsome. [Obs.] land. 2. Apt to find fault; habitually complaining; disposed to murmur; as, a querulous man or people. Enmity can hardly be more annoying that querulous, jealous, exacting fondness. Macaulay. 3. Expressing complaint; fretful; whining; as, a querulous tone of voice. Syn. -- Complaining; bewailing; lamenting; whining; mourning; murmuring; discontented; dissatisfied. -- Quer\\"u*lous*ly, adv. -- Quer\\"u*lous*ness, n.","quintal":"1. A hundredweight, either 112 or 100 pounds, according to the scale used. Cf. Cental. [Sometimes written and pronounced kentle.] 2. A metric measure of weight, being 100,000 grams, or 100 kilograms, equal to 220.46 pounds avoirdupois.","quince":"1. The fruit of a shrub (Cydonia vulgaris) belonging to the same tribe as the apple. It somewhat resembles an apple, but differs in having many seeds in each carpel. It has hard flesh of high flavor, but very acid, and is largely used for marmalade, jelly, and preserves. 2. (Bot.)  a quince tree or shrub. Japan quince (Bot.), an Eastern Asiatic shrub (Cydonia, formerly Pyrus, Japonica) and its very fragrant but inedible fruit. The shrub has very showy flowers, usually red, but sometimes pink or white, and is much grown for ornament. -- Quince curculio (Zo\xf6l.), a small gray and yellow curculio (Conotrachelus crat\xe6gi) whose larva lives in quinces. -- Quince tree (Bot.), the small tree (Cydonia vulgaris) which produces the quince.","quaternion":"1. The number four. [Poetic] 2. A set of four parts, things, or person; four things taken collectively; a group of four words, phrases, circumstances, facts, or the like. Delivered him to four quaternions of soldiers. Acts xii. 4. Ye elements, the eldest birth Of Nature\'s womb, that in quaternion run. Milton. The triads and quaternions with which he loaded his sentences. Sir W. Scott. 3. A word of four syllables; a quadrisyllable. 4. (Math.)  The quotient of two vectors, or of two directed right lines in space, considered as depending on four geometrical elements, and as expressible by an algebraic symbol of quadrinomial form. Note: The science or calculus of quaternions is a new mathematical method, in which the conception of a quaternion is unfolded and symbolically expressed, and is applied to various classes of algebraical, geometrical, and physical questions, so as to discover theorems, and to arrive at the solution of problems. Sir W. R. Hamilton.\\n\\nTo divide into quaternions, files, or companies. Milton.","quillet":"Subtilty; nicety; quibble. \\"Nice, sharp quillets of the law.\\" Shak.","que":"A half farthing. [Obs.]","quiesce":"To be silent, as a letter; to have no sound. M. Stuart.","q":", the seventeenth letter of the English alphabet, has but one sound (that of k), and is always followed by u, the two letters together being sounded like kw, except in some words in which the u is silent. See Guide to Pronunciation, \xa7 249. Q is not found in Anglo-Saxon, cw being used instead of qu; as in cwic, quick; cwen, queen. The name (ku) is from the French ku, which is from the Latin name of the same letter; its form is from the Latin, which derived it, through a Greek alphabet, from the Phoenician, the ultimate origin being Egyptian. Etymologically, q or qu is most nearly related to a (ch, tch), p, q, and wh; as in cud, quid, L. equus, ecus, horse, Gr. equine, hippic; L. quod which, E. what; L. aquila, E. eaqle; E. kitchen, OE. kichene, AS. cycene, L. coquina.","quartering":"1. (Naut.)  Coming from a point well abaft the beam, but not directly astern; -- said of waves or any moving object. 2. (Mach.)  At right angles, as the cranks of a locomotive, which are in planes forming a right angle with each other.\\n\\n1. A station. [Obs.] Bp. Montagu. 2. Assignment of quarters for soldiers; quarters. 3. (Her.) (a) The division of a shield containing different coats of arms into four or more compartments. (b) One of the different coats of arms arranged upon an escutcheon, denoting the descent of the bearer. 4. (Arch.)  A series of quarters, or small upright posts. See Quarter, n., 1 (m) (Arch.) Gwilt. Quartering block, a block on which the body of a condemned criminal was quartered. Macaulay.","quadrupedal":"Having four feet; of or pertaining to a quadruped.","queen":"1. The wife of a king. 2. A woman who is the sovereign of a kingdom; a female monarch; as, Elizabeth, queen of England; Mary, queen of Scots. In faith, and by the heaven\'s quene. Chaucer. 3. A woman eminent in power or attractions; the highest of her kind; as, a queen in society; -- also used figuratively of cities, countries, etc. \\" This queen of cities.\\" \\" Albion, queen of isles.\\" Cowper. 4. The fertile, or fully developed, female of social bees, ants, and termites. 5 5, (Chess)  The most powerful, and except the king the most important, piece in a set of chessmen. 6. A playing card bearing the picture of a queen; as, the queen of spades.  A male homosexual, esp. one who is effeminate or dresses in women\'s clothing. Sometimes pejorative. Queen apple. Etym: [Cf. OE. quyne aple quince apple.] A kind of apple; a queening. \\"Queen apples and red cherries.\\" Spenser. -- Queen bee (Zo\xf6l.), a female bee, especially the female of the honeybee. See Honeybee. -- Queen conch (Zo\xf6l.), a very large West Indian cameo conch (Cassis cameo). It is much used for making cameos. -- Queen consort, the wife of a reigning king. Blackstone. -- Queen dowager, the widow of a king. -- Queen gold, formerly a revenue of the queen consort of England, arising from gifts, fines, etc. -- Queen mother, a queen dowager who is also mother of the reigning king or queen. -- Queen of May. See May queen, under May. -- Queen of the meadow (Bot.), a European herbaceous plant (Spir\xe6a Ulmaria). See Meadowsweet. -- Queen of the prairie (Bot.), an American herb (Spir\xe6a lobata) with ample clusters of pale pink flowers. -- Queen pigeon (Zo\xf6l.), any one of several species of very large and handsome crested ground pigeons of the genus Goura, native of New Guinea and the adjacent islands. They are mostly pale blue, or ash- blue, marked with white, and have a large occipital crest of spatulate feathers. Called also crowned pigeon, goura, and Victoria pigeon. -- Queen regent, or Queen regnant, a queen reigning in her own right. -- Queen\'s Bench. See King\'s Bench. -- Queen\'s counsel, Queen\'s evidence. See King\'s counsel, King\'s evidence, under King. -- Queen\'s delight (Bot.), an American plant (Stillinqia sylvatica) of the Spurge family, having an herbaceous stem and a perennial woody root. -- Queen\'s metal (Metal.), an alloy somewhat resembling pewter or britannia, and consisting essentially of tin with a slight admixture of antimony, bismuth, and lead or copper. -- Queen\'s pigeon. (Zo\xf6l.) Same as Queen pigeon, above. -- Queen\'s ware, glazed English earthenware of a cream color. -- Queen\'s yellow (Old Chem.), a heavy yellow powder consisting of a basic mercuric sulphate; -- formerly called turpetum minerale, or Turbith\'s mineral.\\n\\nTo act the part of a queen. Shak.\\n\\nTo make a queen (or other piece, at the player\'s discretion) of by moving it to the eighth row; as, to queen a pawn.","quicken":"1. To make alive; to vivify; to revive or resuscitate, as from death or an inanimate state; hence, to excite; to, stimulate; to incite. The mistress which I serve quickens what\'s dead. Shak. Like a fruitful garden without an hedge, that quickens the appetite to enjoy so tempting a prize. South. 2. To make lively, active, or sprightly; to impart additional energy to; to stimulate; to make quick or rapid; to hasten; to accelerate; as, to quicken one\'s steps or thoughts; to quicken one\'s departure or speed. 3. (Shipbuilding)  To shorten the radius of (a curve); to make (a curve) sharper; as, to quicken the sheer, that is, to make its curve more pronounced. Syn. -- To revive; resuscitate; animate; reinvigorate; vivify; refresh; stimulate; sharpen; incite; hasten; accelerate; expedite; dispatch; speed.\\n\\n1. To come to life; to become alive; to become vivified or enlivened; hence, to exhibit signs of life; to move, as the fetus in the womb. The heart is the first part that quickens, and the last that dies. Ray. And keener lightnings quicken in her eye. Pope. When the pale and bloodless east began To quicken to the sun. Tennyson. 2. To move with rapidity or activity; to become accelerated; as, his pulse quickened.","quindecylic":"Pertaining to, or designating, an acid of the fatty acid series, containing fifteen atoms of carbon; called also pentadecylic acid.","quartation":"The act, process, or result (in the process of parting) of alloying a button of nearly pure gold with enough silver to reduce the fineness so as to allow acids to attack and remove all metals except the gold; -- called also inquartation. Compare Parting.","quenouille training":"A method of training trees or shrubs in the shape of a cone or distaff by tying down the branches and pruning.","quinate":"Growing in sets of five; -- said especially of leaves composed of five leaflets set at the end of a common petiole.\\n\\nA salt of quinic acid. [Written also kinate.]","quitrent":"A rent reserved in grants of land, by the payment of which the tenant is quit from other service. Blackstone. Note: In some of the United States a fee-farm rent is so termed. Burrill.","queasily":"In a queasy manner.","questioner":"One who asks questions; an inquirer. \\"Little time for idle questioners.\\" Tennyson.","quinquelocular":"Having five cells or loculi; five-celled; as, a quinquelocular pericarp.","quinquefoliated":"Having five leaves or leaflets. Gray.","quiescent":"1. Being in a state of repose; at rest; still; not moving; as, a quiescent body or fluid. 2. Not ruffed with passion; unagitated; not in action; not excited; quiet; dormant; resting. In times of national security, the feeling of patriotism . . . is so quiescent that it seems hardly to exist. Prof. Wilson. 3. (Gram.)  Not sounded; silent; as, y is quiescent in \\"day\\" and \\"say.\\"\\n\\nA silent letter. M. Stuart.","quadruplication":"The act of making fourfold; a taking four times the simple sum or amount.","quitclaim":"A release or relinquishment of a claim; a deed of release; an instrument by which some right, title, interest, or claim, which one person has, or is supposed to have, in or to an estate held by himself or another, is released or relinquished, the grantor generally covenanting only against persons who claim under himself.\\n\\nTo release or relinquish a claim to; to release a claim to by deed, without covenants of warranty against adverse and paramount titles.","quitter":"1. One who quits. 2. A deliverer. [Obs.] Ainsworth.","quinhydrone":"A green crystalline substance formed by the union of quinone with hydroquinone, or as an intermediate product in the oxidation of hydroquinone or the reduction of quinone. [Written also chinhydrone.]","quadrille":"1. A dance having five figures, in common time, four couples of dancers being in each set. 2. The appropriate music for a quadrille.\\n\\nA game played by four persons with forty cards, being the remainder of an ordinary pack after the tens, nines, and eights are discarded. Hoyle.","quaschi":"The brown coati. See Coati.","quarter-saw":"To saw (a log) into quarters; specif., to saw into quarters and then into boards, as by cutting alternately from each face of a quarter, to secure lumber that will warp relatively little or show the grain advantageously.","quarry-man":"A man who is engaged in quarrying stones; a quarrier.","quair":"A quire; a book. [Obs.] \\" The king\'s quhair.\\" James I. (of Scotland).","quietism":"1. Peace or tranquillity of mind; calmness; indifference; apathy; dispassion; indisturbance; inaction. 2. (Eccl. Hist.)  The system of the Quietists, who maintained that religion consists in the withdrawal of the mind from worldly interests and anxieties and its constant employment in the passive contemplation of God and his attributes.","quincewort":"The squinancy. Called also quinsywort.","quish":"See Cuish.","quindecemvir":"One of a sacerdotal college of fifteen men whose chief duty was to take care of the Sibylline books.","quadriga":"A car or chariot drawn by four horses abreast.","quietistic":"Of or pertaining to the Quietists, or to Quietism.","quaigh":"A small shallow cup or drinking vessel. [Scot.] [Written also quegh.]","quayage":"Wharfage. [Also keyage.]","quandary":"A state of difficulty or perplexity; doubt; uncertainty.\\n\\nTo bring into a state of uncertainty, perplexity, or difficulty. [Obs.] Otway.","quinizarin":"A yellow crystalline substance produced artificially. It is isomeric with alizarin.","quininism":"See Cinchonism.","quinquelobate":"Cut less than halfway into portions, usually somewhat rounded; five-lobed; as, a quinquelobate leaf or corolla.","quicken tree":"The European rowan tree; -- called also quickbeam, and quickenbeam. See Rowan tree.","quinqueangled":"Having five angles; quinquangular.","quixotically":"In a quixotic way.","qualified":"1. Fitted by accomplishments or endowments. 2. Modified; limited; as, a qualified statement. Qualified fee (Law), a base fee, or an estate which has a qualification annexed to it, the fee ceasing with the qualification, as a grant to A and his heirs, tenants of the manor of Dale. -- Qualified indorsement (Law), an indorsement which modifies the liability of the indorser that would result from the general principles of law, but does not affect the negotiability of the instrument. Story. -- Qualified negative (Legislation), a limited veto power, by which the chief executive in a constitutional government may refuse assent to bills passed by the legislative body, which bills therefore fail to become laws unless upon a reconsideration the legislature again passes them by a certain majority specified in the constitution, when they become laws without the approval of the executive. Qualified property (Law), that which depends on temporary possession, as that in wild animals reclaimed, or as in the case of a bailment. Syn. -- Competent; fit; adapted. -- Qualified, Competent. Competent is most commonly used with respect to native endowments and general ability suited to the performance of a task or duty; qualified with respect to specific acquirements and training.","quandy":"The old squaw. [Local, U. S.]","quadrate":"1. Having four equal sides, the opposite sides parallel, and four right angles; square. Figures, some round, some triangle, some quadrate. Foxe. 2. Produced by multiplying a number by itself; square. \\" Quadrate and cubical numbers.\\" Sir T. Browne. 3. Square; even; balanced; equal; exact. [Archaic] \\" A quadrate, solid, wise man.\\" Howell. 4. Squared; suited; correspondent. [Archaic] \\" A generical description quadrate to both.\\" Harvey. Quadrate bone (Anat.), a bone between the base of the lower jaw and the skull in most vertebrates below the mammals. In reptiles and birds it articulates the lower jaw with the skull; in mammals it is represented by the malleus or incus.\\n\\n1. (Geom.)  A plane surface with four equal sides and four right angles; a square; hence, figuratively, anything having the outline of a square. At which command, the powers militant That stood for heaven, in mighty quadrate joined. Milton. 2. (Astrol.)  An aspect of the heavenly bodies in which they are distant from each other 90\xba, or the quarter of a circle; quartile. See the Note under Aspect, 6. 3. (Anat.)  The quadrate bone.\\n\\nTo square; to agree; to suit; to correspond; -- followed by with. [Archaic] The objections of these speculatists of its forms do not quadrate with their theories. Burke.\\n\\nTo adjust (a gun) on its carriage; also, to train (a gun) for horizontal firing.","quadrennial":"1. Comprising four years; as, a quadrennial period. 2. Occurring once in four years, or at the end of every four years; as, quadrennial games.","quadripartite":"Divided into four parts.","qui vive":"The challenge of a French sentinel, or patrol; -- used like the English challenge: \\"Who comes there\\" To be on the qui vive, to be on guard; to be watchful and alert, like a sentinel.","quick":"1. Alive; living; animate; -- opposed to dead or inanimate. Not fully quyke, ne fully dead they were. Chaucer. The Lord Jesus Christ, who shall judge the quick and the dead at his appearing and his kingdom. 2 Tim. iv. 1. Man is no star, but a quick coal Of mortal fire. Herbert. Note: In this sense the word is nearly obsolete, except in some compounds, or in particular phrases. 2. Characterized by life or liveliness; animated; sprightly; agile; brisk; ready. \\" A quick wit.\\" Shak. 3. Speedy; hasty; swift; not slow; as, be quick Oft he her his charge of quick return Repeated. Milton. 4. Impatient; passionate; hasty; eager; eager; sharp; unceremonious; as, a quick temper. The bishop was somewhat quick with them, and signified that he was much offended. Latimer. 5. Fresh; bracing; sharp; keen. The air is quick there, And it pierces and sharpens the stomach. Shak. 6. Sensitive; perceptive in a high degree; ready; as, a quick ear. \\"To have an open ear, a quick eye.\\" Shak. They say that women are so quick. Tennyson. 7. Pregnant; with child. Shak. Quick grass. (Bot.) See Quitch grass. -- Quick match. See under Match. -- Quick vein (Mining), a vein of ore which is productive, not barren. -- Quick vinegar, vinegar made by allowing a weak solution of alcohol to trickle slowly over shavings or other porous material. -- Quick water, quicksilver water. -- Quick with child, pregnant with a living child. Syn. -- Speedy; expeditious; swift; rapid; hasty; prompt; ready; active; brisk; nimble; fleet; alert; agile; lively; sprightly.\\n\\nIn a quick manner; quickly; promptly; rapidly; with haste; speedily; without delay; as, run quick; get back quick. If we consider how very quick the actions of the mind are performed. Locke.\\n\\n1. That which is quick, or alive; a living animal or plant; especially, the hawthorn, or other plants used in making a living hedge. The works . . . are curiously hedged with quick. Evelyn. 2. The life; the mortal point; a vital part; a part susceptible of serious injury or keen feeling; the sensitive living flesh; the part of a finger or toe to which the nail is attached; the tender emotions; as, to cut a finger nail to the quick; to thrust a sword to the quick, to taunt one to the quick; -- used figuratively. This test nippeth, . . . this toucheth the quick. Latimer. How feebly and unlike themselves they reason when they come to the quick of the difference ! Fuller. 3. (Bot.)  Quitch grass. Tennyson.\\n\\nTo revive; to quicken; to be or become alive. [Obs.] Chaucer.","quinquennial":"Occurring once in five years, or at the end of every five years; also, lasting five years. A quinquennial event.","quadrilobate":"Having four lobes; as, a quadrilobate leaf.","quellio":"A ruff for the neck. [Obs.] B. Jonson.","quern":"A mill for grinding grain, the upper stone of which was turned by hand; -- used before the invention of windmills and watermills. Shak. They made him at the querne grind. Chaucer.","quaere":"Inquire; question; see; -- used to signify doubt or to suggest investigation.","quester":"One who seeks; a seeker. [Obs.]","quinquefoliate":"Having five leaves or leaflets. Gray.","quencher":"One who, or that which, quenches. Hammond.","quoke":"imp. of Quake. Chaucer.","quotient":"1. (Arith.)  The number resulting from the division of one number by another, and showing how often a less number is contained in a greater; thus, the quotient of twelve divided by four is three. 2. (Higher Alg.)  The result of any process inverse to multiplication. See the Note under Multiplication.","quinquevalve":"Having five valves, as a pericarp.","quotationist":"One who makes, or is given to making, quotations. The narrow intellectuals of quotationists. Milton.","quartzose":"Containing, or resembling, quartz; partaking of the nature or qualities of quartz.","quintilllion":"According to the French notation, which is used on the Continent and in America, the cube of a million, or a unit with eighteen ciphers annexed; according to the English notation, a number produced by involving a million to the fifth power, or a unit with thirty ciphers annexed. See the Note under Numeration.","quittor":"A chronic abscess, or fistula of the coronet, in a horse\'s foot, resulting from inflammation of the tissues investing the coffin bone.","quitch":"1. (Bot.)  Same as Quitch grass. 2. Figuratively: A vice; a taint; an evil. To pick the vicious quitch Of blood and custom wholly out of him. Tennyson .","qualifiable":"Capable of being qualified; abatable; modifiable. Barrow.","quite":"See Quit. [Obs.] Chaucer.\\n\\n1. Completely; wholly; entirely; totally; perfectly; as, the work is not quite done; the object is quite accomplished; to be quite mistaken. Man shall not quite be lost, but saved who will. Milton. The same actions may be aimed at different ends, and arise from quite contrary principles. Spectator. 2. To a great extent or degree; very; very much; considerably. \\"Quite amusing.\\" Macaulay. He really looks quite concerned. Landor. The island stretches along the land and is quite close to it. Jowett (Thucyd. ).","quotable":"Capable or worthy of being quoted; as, a quotable writer; a quotable sentence. -- Quot`a*bit\\"i*ty, n. Poe.","quinoyl":"A radical of which quinone is the hydride, analogous to phenyl. [Written also kinoyl.]","quartzoid":"A form of crystal common with quartz, consisting of two six- sided pyramids, base to base.","quadricorn":"Any quadricornous animal.","quadrumane":"One of the Quadrumana.","quave":"See Quaver. [Obs.]\\n\\nTo quaver. [Obs. or Prov. Eng.]","quet":"The common guillemot. [Prov. Eng.]","quadrans":"1. (Rom. Antiq.)  A fourth part of the coin called an as. See 3d As, 2. 2. The fourth of a penny; a farthing. See Cur.","quadratics":"That branch of algebra which treats of quadratic equations.","quartzy":"Quartzose.","quiddative":"Constituting, or containing, the essence of a thing; quidditative.","quaverer":"One who quavers; a warbler.","quadrin":"A small piece of money, in value about a farthing, or a half cent. [Obs.]","quamash":"See Camass.","queerness":"The quality or state of being queer.","quadratojugal":"(a) Of or pertaining to the quadrate and jugal bones. (b) Of or pertaining to the quadratojugal bone. -- n.  The quadratojugal bone. Quadratojugal bone (Anat.), a bone at the base of the lower jaw in many animals.","quoter":"One who quotes the words of another.","quartziferous":"Consisting chiefly of quartz; containing quartz.","quirinal":"Of, pertaining to, or designating, the hill Collis Quirinalis, now Monte Quirinale (one of the seven hills of Rome), or a modern royal place situated upon it. Also used substantively.","quackish":"Like a quack; boasting; characterized by quackery. Burke.","quadrible":"Quadrable. [R.]","quassin":"The bitter principle of quassia, extracted as a white crystalline substance; -- formerly called quassite. [Written also quassiin, and quassine.]","quercitannic":"Pertaining to, or designating, a tannic acid found in oak bark and extracted as a yellowish brown amorphous substance.","queasy":"1. Sick at the stomach; affected with nausea; inclined to vomit; qualmish. 2. Fastidious; squeamish; delicate; easily disturbed; unsettled; ticklish. \\" A queasy question.\\" Shak. Some seek, when queasy conscience has its qualms. Cowper.","quinone":"A crystalline substance, C6H4O2 (called also benzoketone), first obtained by the oxidation of quinic acid and regarded as a double ketone; also, by extension, any one of the series of which quinone proper is the type. [Written also chinone, kinone.]","quinquangular":"Having five angles or corners.","quadric":"Of or pertaining to the second degree.\\n\\n(a) (Alg.) A quantic of the second degree. See Quantic. (b) (Geom.) A surface whose equation in three variables is of the second degree. Spheres, spheroids, ellipsoids, paraboloids, hyperboloids, also cones and cylinders with circular bases, are quadrics.","quoiffure":"See Coiffure.","quidnunc":"One who is curious to know everything that passes; one who knows, or pretends to know, all that is going on. \\"The idle stories of quidnuncs.\\" Motley.","quarterage":"A quarterly allowance.","quinovic":"Pertaining to, or designating, a crystalline acid obtained from some varieties of cinchona bark. [Written also chinovic, and kinovic.]","quinquepartite":"1. Consisting of five parts. 2. (Bot.)  Divided into five parts almost to the base.","quadrangular":"Having four angles, and consequently four sides; tetragonal. -- Quad*ran\\"gu*lar*ly, adv.","quizzism":"The act or habit of quizzing.","questionary":"Inquiring; asking questions; testing. \\"Questionary epistles.\\" Pope.\\n\\nOne who makes it his business to seek after relics and carry them about for sale.","quasi":"As if; as though; as it were; in a manner sense or degree; having some resemblance to; qualified; -- used as an adjective, or a prefix with a noun or an adjective; as, a quasi contract, an implied contract, an obligation which has arisen from some act, as if from a contract; a quasi corporation, a body that has some, but not all, of the peculiar attributes of a corporation; a quasi argument, that which resembles, or is used as, an argument; quasi historical, apparently historical, seeming to be historical.","quebracho":"A Chilian apocynaceous tree (Aspidosperma Quebracho); also, its bark, which is used as a febrifuge, and for dyspnoea of the lung, or bronchial diseases; -- called also white quebracho, to distinguish it from the red quebracho, a Mexican anacardiaceous tree (Loxopterygium Lorentzii) whose bark is said to have similar properties. J. Smith (Dict. Econ. Plants).","querken":"To stifle or choke. [Prov. Eng.] Halliwell.","quorum":"Such a number of the officers or members of any body as is competent by law or constitution to transact business; as, a quorum of the House of Representatives; a constitutional quorum was not present. Note: The term arose from the Latin words, Quorum aliquem vestrum . . . unum esse volumus (of whom we wish some one of you to be one), which were used in the commission formerly issued to justices of the peace in England, by which commission it was directed that no business of certain kinds should be done without the presence of one or more of certain justices specially designated. Justice of the peace and of the quorum designates a class of justices of the peace in some of the United States.","quinzaine":"The fifteenth day after a feast day, including both in the reckoning. [Written also quinzain.]","queme":"To please. [Obs.] Chaucer.","quillback":"An American fresh-water fish (Ictiobus, or Carpiodes, cyprinus); -- called also carp sucker, sailfish, spearfish, and skimback.","quesal":"The long-tailed, or resplendent, trogon (Pharomachus mocinno, formerly Trogon resplendens), native of Southern Mexico and Central America. Called alsoquetzal, and golden trogon. Note: The male is remarkable for the brilliant metallic green and gold colors of his plumage, and for his extremely long plumes, which often exceed three feet in length.","quadrinomical":"Quadrinomial.","quaky":"Shaky, or tremulous; quaking.","quinquevir":"One of five commissioners appointed for some special object.","quintic":"Of the fifth degree or order. -- n. (Alg.)  A quantic of the fifth degree. See Quantic.","quotidian":"Occurring or returning daily; as, a quotidian fever.\\n\\nAnything returning daily; especially (Med.), an intermittent fever or ague which returns every day. Milton.","quatrefoil":"Same as Quarterfoil.","quietage":"Quietness. [Obs.] Spenser.","quarried":"Provided with prey. Now I am bravely quarried. Beau. & Fl.","queenship":"The state, rank, or dignity of a queen.","quest":"1. The act of seeking, or looking after anything; attempt to find or obtain; search; pursuit; as, to rove in quest of game, of a lost child, of property, etc. Upon an hard adventure yet in quest. Spenser. Cease your quest of love. Shak. There ended was his quest, there ceased his care. Milton. 2. Request; desire; solicitation. Gad not abroad at every quest and call Of an untrained hope or passion. Herbert. 3. Those who make search or inquiry, taken collectively. The senate hath sent about three several quests to search you out. Shak. 4. Inquest; jury of inquest. What lawful quest have given their verdict Shak.\\n\\nTo search for; to examine. [R.] Sir T. Herbert.\\n\\nTo go on a quest; to make a search; to go in pursuit; to beg. [R.] If his questing had been unsuccessful, he appeased the rage of hunger with some scraps of broken meat. Macaulay.","queest":"The European ringdove (Columba palumbus); the cushat. [Written also quist, queeze, quice, queece.] See Ringdove.","quick-wittedness":"Readiness of wit. \\"Celtic quick-wittedness.\\" M. Arnold.","quinquelobed":"Same as Quinquelobate.","quizzical":"Relating to quizzing: given to quizzing; of the nature of a quiz; farcical; sportive. -- Quiz\\"zic*al*ly, adv.","quarter":"1. One of four equal parts into which anything is divided, or is regarded as divided; a fourth part or portion; as, a quarter of a dollar, of a pound, of a yard, of an hour, etc. Hence, specifically: (a) The fourth of a hundred-weight, being 25 or 28 pounds, according as the hundredweight is reckoned at 100 or 112 pounds. (b) The fourth of a ton in weight, or eight bushels of grain; as, a quarter of wheat; also, the fourth part of a chaldron of coal. Hutton. (c) (Astron.) The fourth part of the moon\'s period, or monthly revolution; as, the first quarter after the change or full. (d) One limb of a quadruped with the adjacent parts; one fourth part of the carcass of a slaughtered animal, including a leg; as, the fore quarters; the hind quarters. (e) That part of a boot or shoe which forms the side, from the heel to the vamp. (f) (Far.) That part on either side of a horse\'s hoof between the toe and heel, being the side of the coffin. (g) A term of study in a seminary, college, etc, etc.; properly, a fourth part of the year, but often longer or shorter. (h) pl. (Mil.)  The encampment on one of the principal passages round a place besieged, to prevent relief and intercept convoys. (i) (Naut.) The after-part of a vessel\'s side, generally corresponding in extent with the quarter-deck; also, the part of the yardarm outside of the slings. (j) (Her.) One of the divisions of an escutcheon when it is divided into four portions by a horizontal and a perpendicular line meeting in the fess point. Note: When two coats of arms are united upon one escutcheon, as in case of marriage, the first and fourth quarters display one shield, the second and third the other. See Quarter, v. t., 5. (k) One of the four parts into which the horizon is regarded as divided; a cardinal point; a direction\' principal division; a region; a territory. Scouts each coast light-armed scour, Each quarter, to descry the distant foe. Milton. (l) A division of a town, city, or county; a particular district; a locality; as, the Latin quarter in Paris. (m) (Arch.) A small upright timber post, used in partitions; -- in the United States more commonly called stud. (n) (Naut.) The fourth part of the distance from one point of the compass to another, being the fourth part of 11\xb0 15\', that is, about 2\xb0 49\'; -- called also quarter point. 2. Proper station; specific place; assigned position; special location. Swift to their several quarters hasted then The cumbrous elements. Milton. Hence, specifically: (a) (Naut.) A station at which officers and men are posted in battle; -- usually in the plural. (b) Place of lodging or temporary residence; shelter; entertainment; -- usually in the plural. The banter turned as to what quarters each would find. W. Irving. (c) pl. (Mil.)  A station or encampment occupied by troops; a place of lodging for soldiers or officers; as, winter quarters. (d) Treatment shown by an enemy; mercy; especially, the act of sparing the life a conquered enemy; a refraining from pushing one\'s advantage to extremes. He magnified his own clemency, now they were at his mercy, to offer them quarter for their lives. Clarendon. Cocks and lambs . . . at the mercy of cats and wolves . . . must never expect better quarter. L\'Estrange. 3. Friendship; amity; concord. [Obs.] To keep quarter, to keep one\'s proper place, and so be on good terms with another. [Obs.] In quarter, and in terms like bride and groom. Shak. I knew two that were competitors for the secretary\'s place, . . . and yet kept good quarter between themselves. Bacon. False quarter, a cleft in the quarter of a horse\'s foot. -- Fifth quarter, the hide and fat; -- a butcher\'s term. -- On the quarter (Naut.), in a direction between abeam and astern; opposite, or nearly opposite, a vessel\'s quarter. -- Quarter aspect. (Astrol.) Same as Quadrate. -- Quarter back (Football), the player who has position next behind center rush, and receives the ball on the snap back. -- Quarter badge (Naut.), an ornament on the side of a vessel near, the stern. Mar. Dict. -- Quarter bill (Naut.), a list specifying the different stations to be taken by the officers and crew in time of action, and the names of the men assigned to each. -- Quarter block (Naut.), a block fitted under the quarters of a yard on each side of the slings, through which the clew lines and sheets are reeved. R. H. Dana, Jr. -- Quarter boat (Naut.), a boat hung at a vessel\'s quarter. -- Quarter cloths (Naut.), long pieces of painted canvas, used to cover the quarter netting. -- Quarter day, a day regarded as terminating a quarter of the year; hence, one on which any payment, especially rent, becomes due. In matters influenced by United States statutes, quarter days are the first days of January, April, July, and October. In New York and many other places, as between landlord and tenant, they are the first days of May, August, November, and February. The quarter days usually recognized in England are 25th of March (Lady Day), the 24th of June (Midsummer Day), the 29th of September (Michaelmas Day), and the 25th of December (Christmas Day). -- Quarter face, in fine arts, portrait painting, etc., a face turned away so that but one quarter is visible. -- Quarter gallery (Naut.), a balcony on the quarter of a ship. See Gallery, 4. -- Quarter gunner (Naut.), a petty officer who assists the gunner. -- Quarter look, a side glance. [Obs.] B. Jonson. -- Quarter nettings (Naut.), hammock nettings along the quarter rails. -- Quarter note (Mus.), a note equal in duration to half a minim or a fourth of semibreve; a crochet. -- Quarter pieces (Naut.), several pieces of timber at the after- part of the quarter gallery, near the taffrail. Totten. -- Quarter point. (Naut.) See Quarter, n., 1 (n). -- Quarter railing, or Quarter rails (Naut.), narrow molded planks reaching from the top of the stern to the gangway, serving as a fence to the quarter-deck. -- Quarter sessions (Eng. Law), a general court of criminal jurisdiction held quarterly by the justices of peace in counties and by the recorders in boroughs. -- Quarter square (Math.), the fourth part of the square of a number. Tables of quarter squares have been devised to save labor in multiplying numbers. -- Quarter turn, Quarter turn belt (Mach.), an arrangement in which a belt transmits motion between two shafts which are at right angles with each other. -- Quarter watch (Naut.), a subdivision of the full watch (one fourth of the crew) on a man-of- war. -- To give, or show, quarter (Mil.), to accept as prisoner, on submission in battle; to forbear to kill, as a vanquished enemy. -- To keep quarter. See Quarter, n., 3.\\n\\n1. To divide into four equal parts. 2. To divide; to separate into parts or regions. Then sailors quartered heaven. Dryden. 3. To furnish with shelter or entertainment; to supply with the means of living for a time; especially, to furnish shelter to; as, to quarter soldiers. They mean this night in Sardis to be quartered. Shak. 4. To furnish as a portion; to allot. [R.] This isle . . . He quarters to his blue-haired deities. Milton. 5. (Her.)  To arrange (different coats of arms) upon one escutcheon, as when a man inherits from both father and mother the right to bear arms. Note: When only two coats of arms are so combined they are arranged in four compartments. See Quarter, n., 1 (f).\\n\\nTo lodge; to have a temporary residence.\\n\\nTo drive a carriage so as to prevent the wheels from going into the ruts, or so that a rut shall be between the wheels. Every creature that met us would rely on us for quartering. De Quincey.","quarrellous":"Quarrelsome. [Obs.] [Written also quarrellous.] Shak.","quater-cousin":"A cousin within the first four degrees of kindred.","questionnaire":"= Questionary, above.","quassation":"The act of shaking, or the state of being shaken. Gayton.","quenelle":"A kind of delicate forcemeat, commonly poached and used as a dish by itself or for garnishing.","quinoxyl":"The hypothetical radical of certain quinone derivatives related to rhodizonic acid.","queint":"See Quaint. [Obs.]\\n\\nimp. & p. p. of Quench. Chaucer.","quadri":"A combining form meaning four, four times, fourfold; as, quadricapsular, having four capsules.","quakerlike":"Like a Quaker.","quinquefid":"Sharply cut about halfway to the middle or base into five segments; as, a quinquefid leaf or corolla.","quasje":"The brown coati. See Coati.","querulential":"Querulous. [R.]","quadragesimals":"Offerings formerly made to the mother church of a diocese on Mid-Lent Sunday.","quica":"A small South American opossum (Didelphys quica), native of Guiana and Brazil. It feeds upon insects, small birds, and fruit.","quaintness":"The quality of being quaint. Pope.","querist":"One who inquires, or asks questions. Swift.","quarterhung":"Having trunnions the axes of which lie below the bore; -- said of a cannon.","quadrifoil":"Four-leaved; having the leaves in whorls of four.","quicksilvered":"Overlaid with quicksilver, or with an amalgam of quicksilver and tinfoil.","quinquefarious":"Arranged in five vertical rows; pentastichous. Gray.","quinaldine":"A colorless liquid of a slightly pungent odor, C9H6N.CH3, first obtained as a condensation product of aldehyde and aniline, and regarded as a derivative of quinoline; -- called also methyl quinoline. [Written also chinaldine.]","quart":"The fourth part; a quarter; hence, a region of the earth. [Obs.] Camber did possess the western quart. Spenser.\\n\\n1. A measure of capacity, both in dry and in liquid measure; the fourth part of a gallon; the eighth part of a peck; two pints. Note: In imperial measure, a quart is forty English fluid ounces; in wine measure, it is thirty-two American fluid ounces. The United States dry quart contains 67.20 cubic inches, the fluid quart 57.75. The English quart contains 69.32 cubic inches. 2. A vessel or measure containing a quart.\\n\\nIn cards, four successive cards of the same suit. Cf. Tierce, 4. Hoyle.","quaternity":"1. The number four. [Obs.] Sir T. Browne. 2. The union of four in one, as of four persons; -- analogous to the theological term trinity.","quasi corporation":"A corporation consisting of a person or body of persons invested with some of the qualities of an artificial person, though not expressly incorporated, esp. the official of certain municipal divisions such as counties, schools districts, and the towns of some States of the United States, certain church officials, as a churchwarden, etc.","quarrelet":"A little quarrel. See 1st Quarrel, 2. [Obs.] \\"Quarrelets of pearl [teeth].\\" Herrick.","quinquenerved":"Having five nerves; -- said of a leaf with five nearly equal nerves or ribs rising from the end of the petiole.","quagga":"A South African wild ass (Equus, or Hippotigris, quagga). The upper parts are reddish brown, becoming paler behind and behind and beneath, with dark stripes on the face, neck, and fore part of the body.","quavemire":"See Quagmire. [Obs.]","quondam":"Having been formerly; former; sometime. \\"This is the quondam king.\\" Shak.\\n\\nA person dismissed or ejected from a position. [R.] \\"Make them quondams; . . . cast them out of their office.\\" Latimer.","quadrinodal":"Possessing four nodes; as, quadrinodal curves.","quass":"A thin, sour beer, made by pouring warm water on rye or barley meal and letting it ferment, -- much used by the Russians. [written also quas.]","quebec group":"The middle of the three groups into which the rocks of the Canadian period have been divided in the American Lower Silurian system. See the Chart of Geology.","quackery":"The acts, arts, or boastful pretensions of a quack; false pretensions to any art; empiricism. Carlyle.","quodlibetical":"Not restricted to a particular subject; discussed for curiosity or entertainment. -- Quod`li*bet\\"ic*al*ly, adv.","quech":"A word occurring in a corrupt passage of Bacon\'s Essays, and probably meaning, to stir, to move.","quintole":"A group of five notes to be played or sung in the time of four of the same species.","queenfish":"A California sci\xe6noid food fish (Seriphys politus). The back is bluish, and the sides and belly bright silvery. Called also kingfish.","quade":"Evil; bad; baffling; as, a quade wind. [Obs.] Sooth play, quad play, as the Fleming saith. Chaucer.","quadriennial":"Same as Quadrennial.","quoll":"A marsupial of Australia (Dasyurus macrurus), about the size of a cat.","quinquennalia":"Public games celebrated every five years.","questuary":"Studious of profit. [Obs.] Sir T. Browne.\\n\\nOne employed to collect profits. [R.] \\"The pope\'s questuaries.\\" Jer. Taylor.","quartette":"1. (Mus.) (a) A composition in four parts, each performed by a single voice or instrument. (b) The set of four person who perform a piece of music in four parts. 2. (Poet.)  A stanza of four lines.","quadrivalent":"Having a valence of four; capable of combining with, being replaced by, or compared with, four monad atoms; tetravalent; -- said of certain atoms and radicals; thus, carbon and silicon are quadrivalent elements.","quadra":"(a) The plinth, or lowest member, of any pedestal, podium, water table, or the like. (b) A fillet, or listel.","quadrat":"1. (Print.)  A block of type metal lower than the letters, -- used in spacing and in blank lines. [Abbrev. quad.] 2. An old instrument used for taking altitudes; -- called also geometrical square, and line of shadows.","quarrelsome":"Apt or disposed to quarrel; given to brawls and contention; easily irritated or provoked to contest; irascible; choleric. Syn. -- Pugnacious; irritable; irascible; brawling; choleric; fiery; petulant. -- Quar\\"rel*some*ly, adv. -- Quar\\"rel*some*ness, n.","quinism":"See Cinchonism.","quarterstaff":"A long and stout staff formerly used as a weapon of defense and offense; -- so called because in holding it one hand was placed in the middle, and the other between the middle and the end.","quality":"1. The condition of being of such and such a sort as distinguished from others; nature or character relatively considered, as of goods; character; sort; rank. We lived most joyful, obtaining acquaintance with many of the city not of the meanest quality. Bacon 2. Special or temporary character; profession; occupation; assumed or asserted rank, part, or position. I made that inquiry in quality of an antiquary. Gray. 3. That which makes, or helps to make, anything such as it is; anything belonging to a subject, or predicable of it; distinguishing property, characteristic, or attribute; peculiar power, capacity, or virtue; distinctive trait; as, the tones of a flute differ from those of a violin in quality; the great quality of a statesman. Note: Qualities, in metaphysics, are primary or secondary. Primary are those essential to the existence, and even the conception, of the thing, as of matter or spirit Secondary are those not essential to such a conception. 4. An acquired trait; accomplishment; acquisition. He had those qualities of horsemanship, dancing, and fencing which accompany a good breeding. Clarendon. 5. Superior birth or station; high rank; elevated character. \\"Persons of quality.\\" Bacon. Quality binding, a kind of worsted tape used in Scotland for binding carpets, and the like. The quality, those of high rank or station, as distinguished from the masses, or common people; the nobility; the gentry. I shall appear at the masquerade dressed up in my feathers, that the quality may see how pretty they will look in their traveling habits. Addison. Syn. -- Property; attribute; nature; peculiarity; character; sort; rank; disposition; temper.","quartered":"1. Divided into four equal parts or quarters; separated into four parts or regions. 2.  Furnished with quarters; provided with shelter or entertainment. 3.  Quarter-sawed; -- said of timber, commonly oak.","questman":"One legally empowered to make quest of certain matters, esp. of abuses of weights and measures. Specifically: (a) A churchwarden\'s assistant; a sidesman. Blount. [Obs.] (b) A collector of parish rents. Blount. [Obs.]","quotum":"Part or proportion; quota. [R.] \\"A very small quotum.\\" Max M\xfcller.","quibble":"1. A shift or turn from the point in question; a trifling or evasive distinction; an evasion; a cavil. Quibbles have no place in the search after truth. I. Watts. 2. A pun; a low conceit.\\n\\n1. To evade the point in question by artifice, play upon words, caviling, or by raising any insignificant or impertinent question or point; to trifle in argument or discourse; to equivocate. 2. To pun; to practice punning. Cudworth. Syn. -- To cavil; shuffle; equivocate; trifle.","quirked":"Having, or formed with, a quirk or quirks.","quinidine":"An alkaloid isomeric with, and resembling, quinine, found in certain species of cinchona, from which it is extracted as a bitter white crystalline substance; conchinine. It is used somewhat as a febrifuge. [Written also chinidine.]","quittance":"1. Discharge from a debt or an obligation; acquittance. Omittance is no quittance. Shak. 2. Recompense; return; repayment. [Obs.] Shak.\\n\\nTo repay; to requite. [Obs.] Shak.","queer":"1. At variance with what is usual or normal; differing in some odd way from what is ordinary; odd; singular; strange; whimsical; as, a queer story or act. \\" A queer look.\\" W. Irving. 2. Mysterious; suspicious; questionable; as, a queer transaction. [Colloq.]\\n\\nCounterfeit money. [Slang] To shove the queer, to put counterfeit money in circulation. [Slang]","quaintise":"1. Craft; subtlety; cunning. [Obs.] Chaucer. R. of Glouces. 2. Elegance; beauty. [Obs.] Chaucer.","quick-scented":"Acute of smell.","quick-sighted":"Having quick sight or acute discernment; quick to see or to discern. Locke. --Quick\\"-sight`ed*ness, n.","quinqueliteral":"Consisting of five letters.","quoth":"Said; spoke; uttered; -- used only in the first and third persons in the past tenses, and always followed by its nominative, the word or words said being the object; as, quoth I. quoth he. \\"Let me not live, quoth he.\\" Shak.","quickener":"One who, or that which, quickens.","quail":"1. To die; to perish; hence, to wither; to fade. [Obs.] Spenser. 2. To become quelled; to become cast down; to sink under trial or apprehension of danger; to lose the spirit and power of resistance; to lose heart; to give way; to shrink; to cower. The atheist power shall quail, and confess his fears. I. Taylor. Stouter hearts than a woman\'s have quailed in this terrible winter. Longfellow. Syn. -- to cower; flinch; shrink; quake; tremble; blench; succumb; yield.\\n\\nTo cause to fail in spirit or power; to quell; to crush; to subdue. [Obs.] Spenser.\\n\\nTo curdle; to coagulate, as milk. [Obs.] Holland.\\n\\n1. (Zo\xf6l.)  Any gallinaceous bird belonging to Coturnix and several allied genera of the Old World, especially the common European quail (C. communis), the rain quail (C. Coromandelica) of India, the stubble quail (C. pectoralis), and the Australian swamp quail (Synoicus australis). 2. (Zo\xf6l.)  Any one of several American partridges belonging to Colinus, Callipepla, and allied genera, especially the bobwhite (called Virginia quail, and Maryland quail), and the California quail (Calipepla Californica). 3. (Zo\xf6l.)  Any one of numerous species of Turnix and allied genera, native of the Old World, as the Australian painted quail (Turnix varius). See Turnix. 4. A prostitute; -- so called because the quail was thought to be a very amorous bird.[Obs.] Shak. Bustard quail (Zo\xf6l.), a small Asiatic quail-like bird of the genus Turnix, as T. taigoor, a black-breasted species, and the hill bustard quail (T. ocellatus). See Turnix. -- Button quail (Zo\xf6l.), one of several small Asiatic species of Turnix, as T. Sykesii, which is said to be the smallest game bird of India. -- Mountain quail. See under Mountain. -- Quail call, a call or pipe for alluring quails into a net or within range. -- Quail dove (Zo\xf6l.), any one of several American ground pigeons belonging to Geotrygon and allied genera. -- Quail hawk (Zo\xf6l.), the New Zealand sparrow hawk (Hieracidea Nov\xe6-Hollandi\xe6). -- Quail pipe. See Quail call, above. -- Quail snipe (Zo\xf6l.), the dowitcher, or red-breasted snipe; -- called also robin snipe, and brown snipe. -- Sea quail (Zo\xf6l.), the turnstone. [Local, U. S.]","quoif":"See Coif. Shak.","quindism":"A fifteenth. [Obs.] Prynne.","quadricornous":"Having four horns, or hornlike organs; as, a quadricornous beetle.","quinology":"The science which treats of the cultivation of the cinchona, and of its use in medicine.","quartridge":"Quarterage. [Obs.]","queck":"A word occurring in a corrupt passage of Bacon\'s Essays, and probably meaning, to stir, to move.","quadruplicate":"To make fourfold; to double twice; to quadruple.\\n\\n1. Fourfold; doubled twice; four times repeated; as, a quadruplicate ratio, or a quadruplicate proportion. 2. (Math.)  Raised to the fourth power. [R.]","quietsome":"Calm; still. [Obs.] Spenser.","quartet":"1. (Mus.) (a) A composition in four parts, each performed by a single voice or instrument. (b) The set of four person who perform a piece of music in four parts. 2. (Poet.)  A stanza of four lines.","quilting":"1. The act of stitching or running in patterns, as in making a quilt. 2. A quilting bee. See Bee, 2. 3. The material used for making quilts. 4. (Naut.)  A coating of strands of rope for a water vessel.","quaintly":"In a quaint manner. Shak.","quarrier":"A worker in a stone quarry.","questionableness":"The quality or state of being questionable, doubtful, or suspicious.","quietly":"1. In a quiet state or manner; without motion; in a state of rest; as, to lie or sit quietly. 2. Without tumult, alarm, dispute, or disturbance; peaceably; as, to live quietly; to sleep quietly. 3. Calmly, without agitation or violent emotion; patiently; as, to submit quietly to unavoidable evils. 4. Noiselessly; silently; without remark or violent movement; in a manner to attract little or no observation; as, he quietly left the room.","quinoidine":"A brownish resinous substance obtained as a by-product in the treatment of cinchona bark. It consists of a mixture of several alkaloids. [Written also chinoidine.]","quotiety":"The relation of an object to number. Krauth-Fleming.","querele":"A complaint to a court. See Audita Querela. [Obs.] Ayliffe.","quadrant":"1. The fourth part; the quarter. [Obs.] Sir T. Browne. 2. (Geom.)  The quarter of a circle, or of the circumference of a circle, an arc of 90\xba, or one subtending a right angle at the center. 3. (Anal. (Geom.)  One of the four parts into which a plane is divided by the co\xf6rdinate axes. The upper right-hand part is the first quadrant; the upper left-hand part the second; the lower left-hand part the third; and the lower right-hand part the fourth quadrant. 4. An instrument for measuring altitudes, variously constructed and mounted for different specific uses in astronomy, surveying, gunnery, etc., consisting commonly of a graduated arc of 90\xba, with an index or vernier, and either plain or telescopic sights, and usually having a plumb line or spirit level for fixing the vertical or horizontal direction. Gunner\'s quadrant, an instrument consisting of a graduated limb, with a plumb line or spirit level, and an arm by which it is applied to a cannon or mortar in adjusting it to the elevation required for attaining the desired range. -- Gunter\'s quadrant. See Gunter\'s quadrant, in the Vocabulary. Hadley\'s quadrant, a hand instrument used chiefly at sea to measure the altitude of the sun or other celestial body in ascertaining the vessel\'s position. It consists of a frame in the form of an octant having a graduated scale upon its arc, and an index arm, or alidade pivoted at its apex. Mirrors, called the index glass and the horizon glass, are fixed one upon the index arm and the other upon one side of the frame, respectively. When the instrument is held upright, the index arm may be swung so that the index glass will reflect an image of the sun upon the horizon glass, and when the reflected image of the sun coincides, to the observer\'s eye, with the horizon as seen directly through an opening at the side of the horizon glass, the index shows the sun\'s altitude upon the scale; -- more properly, but less commonly, called an octant. -- Quadrant of altitude, an appendage of the artificial globe, consisting of a slip of brass of the length of a quadrant of one of the great circles of the globe, and graduated. It may be fitted to the meridian, and being movable round to all points of the horizon, serves as a scale in measuring altitudes, azimuths, etc.","queue":"(a) A tail-like appendage of hair; a pigtail. (b) A line of persons waiting anywhere.\\n\\nTo fasten, as hair, in a queue.","quin":"A European scallop (Pecten opercularis), used as food. [Prov. Eng.]","quiescence":"The state or quality of being quiescent. \\"Quiescence, bodily and mental.\\" H. Spencer. Deeds will be done; -- while be boasts his quiescence. R. Browning.","quop":"See Quob.","quietude":"Rest; repose; quiet; tranquillity. Shelley.","questmonger":"One who lays informations, and encourages petty lawsuits. [Obs.] Bacon.","quartzous":"Quarzose.","quadriceps":"The great extensor muscle of the knee, divided above into four parts which unite in a single tendon at the knee.","querry":"A groom; an equerry. [Obs.]","quits":"See the Note under Quit, a.","quata":"The coaita.","quoit":"1. (a) A flattened ring-shaped piece of iron, to be pitched at a fixed object in play; hence, any heavy flat missile used for the same purpose, as a stone, piece of iron, etc. (b) pl.  A game played with quoits. Shak. 2. The discus of the ancients. See Discus. 3. A cromlech. [Prov. Eng.] J. Morley.\\n\\nTo throw quoits; to play at quoits. To quoit, to run, and steeds and chariots drive. Dryden.\\n\\nTo throw; to pitch. [Obs. or R.] Shak.","quadrilateral":"Having four sides, and consequently four angles; quadrangular.\\n\\n1. (Geom.)  A plane figure having four sides, and consequently four angles; a quadrangular figure; any figure formed by four lines. 2. An area defended by four fortresses supporting each other; as, the Venetian quadrilateral, comprising Mantua, Peschiera, Verona, and Legnano. Complete quadrilateral (Geom.), the figure made up of the six straight lines that can be drawn through four points, A., B, C, I, the lines being supposed to be produced indefinitely.","quakerly":"Resembling Quakers; Quakerlike; Quakerish. Macaulay.","quatch":"Squat; flat. [Obs.] Shak.","quotation":"1. The act of quoting or citing. 2. That which is quoted or cited; a part of a book or writing named, repeated, or adduced as evidence or illustration. Locke. 3. (Com.)  The naming or publishing of the current price of stocks, bonds, or any commodity; also the price named. 4. Quota; share. [Obs.] 5. (print.)  A piece of hollow type metal, lower than type, and measuring two or more pica ems in length and breadth, used in the blank spaces at the beginning and end of chapters, etc. Quotation marks (Print.), two inverted commas placed at the beginning, and two apostrophes at the end, of a passage quoted from an author in his own words.","quarry":"Same as 1st Quarrel. [Obs.] Fairfax.\\n\\nQuadrate; square. [Obs.]\\n\\n1. (a) A part of the entrails of the beast taken, given to the hounds. (b) A heap of game killed. 2. The object of the chase; the animal hunted for; game; especially, the game hunted with hawks. \\"The stone-dead quarry.\\" Spenser. The wily quarry shunned the shock. Sir W. Scott.\\n\\nTo secure prey; to prey, as a vulture or harpy. L\'Estrange.\\n\\nA place, cavern, or pit where stone is taken from the rock or ledge, or dug from the earth, for building or other purposes; a stone pit. See 5th Mine (a).\\n\\nTo dig or take from a quarry; as, to quarry marble.","quadrireme":"A galley with four banks of oars or rowers.","querimony":"A complaint or complaining. [Obs.] E. Hall.","quinquarticular":"Relating to the five articles or points; as, the quinquarticular controversy between Arminians and Calvinists. [Obs.] Bp. Sanderson.","quinquivalent":"Same as Pentavalent.","quiet":"1. In a state of rest or calm; without stir, motion, or agitation; still; as, a quiet sea; quiet air. They . . . were quiet all the night, saying, In the morning, when it is day, we shall kill him. Judg. xvi. 2. 2. Free from noise or disturbance; hushed; still. 3. Not excited or anxious; calm; peaceful; placid; settled; as, a quiet life; a quiet conscience. \\" So quiet and so sweet a style.\\" Shak. That son, who on the quiet state of man Such trouble brought. Milton. 4. Not giving offense; not exciting disorder or trouble; not turbulent; gentle; mild; meek; contented. The ornament of a meek and quiet spirit. 1 Pet. iii. 4. I will sit as quiet as a lamb. Shak. 5. Not showy; not such as to attract attention; undemonstrative; as, a quiet dress; quiet colors; a quiet movement. Syn. -- Still; tranquil; calm; unruffled; smooth; unmolested; undisturbed; placid; peaceful; mild; peaceable; meek; contented.\\n\\n1. The quality or state of being quiet, or in repose; as an hour or a time of quiet. 2. Freedom from disturbance, noise, or alarm; stillness; tranquillity; peace; security. And join with thee, calm Peace and Quiet. Milton. At quiet, still; peaceful. -- In quiet, quietly. \\" I will depart in quiet.\\" Shak. -- Out of quiet, disturbed; restless. [Obs.] \\"She is much out of quiet.\\" Shak.\\n\\n1. To stop motion in; to still; to reduce to a state of rest, or of silence. 2. To calm; to appease; to pacify; to lull; to allay; to tranquillize; as, to quiet the passions; to quiet clamors or disorders; to quiet pain or grief. Quiet yourselves, I pray, and be at peace. Shak.\\n\\nTo become still, silent, or calm; -- often with down; as, be soon quieted down.","quercus":"A genus of trees constituted by the oak. See Oak.","quietness":"The quality or state of being quiet; freedom from noise, agitation, disturbance, or excitement; stillness; tranquillity; calmness. I would have peace and quietness. Shak.","questrist":"A seeker; a pursuer. [Obs.] \\"Hot questrists after him.\\" Shak.","quarterpace":"A platform of a staircase where the stair turns at a right angle only. See Halfpace.","quacksalver":"One who boasts of his skill in medicines and salves, or of the efficacy of his prescriptions; a charlatan; a quack; a mountebank. [Obs.] Burton.","queen truss":"A truss framed with queen-posts; a queen-post truss.","quartz":"A form of silica, or silicon dioxide (SiO2), occurring in hexagonal crystals, which are commonly colorless and transparent, but sometimes also yellow, brown, purple, green, and of other colors; also in cryptocrystalline massive forms varying in color and degree of transparency, being sometimes opaque. Note: The crystalline varieties include: amethyst, violet; citrine and false topaz, pale yellow; rock crystal, transparent and colorless or nearly so; rose quartz, rosecolored; smoky quartz, smoky brown. The chief crypto-crystalline varieties are: agate, a chalcedony in layers or clouded with different colors, including the onyx and sardonyx; carnelian and sard, red or flesh-colored chalcedony; chalcedony, nearly white, and waxy in luster; chrysoprase, an apple- green chalcedony; flint, hornstone, basanite, or touchstone, brown to black in color and compact in texture; heliotrope, green dotted with red; jasper, opaque, red yellow, or brown, colored by iron or ferruginous clay; prase, translucent and dull leek-green. Quartz is an essential constituent of granite, and abounds in rocks of all ages. It forms the rocks quartzite (quartz rock) and sandstone, and makes most of the sand of the seashore.","quadragesimal":"Belonging to Lent; used in Lent; Lenten.","queasiness":"The state of being queasy; nausea; qualmishness; squeamishness. Shak.","quadrijugate":"Same as Quadrijugous.","quintin":"See Quintain.","quid":"A portion suitable to be chewed; a cud; as, a quid of tobacco.\\n\\nTo drop from the mouth, as food when partially chewed; -- said of horses. Youatt.","quadripennate":"Having four wings; -- said of insects.","quarterfoil":"An ornamental foliation having four lobes, or foils.","quaternary":"1. Consisting of four; by fours, or in sets of four. 2. (Geol.)  Later than, or subsequent to, the Tertiary; Post-tertiary; as, the Quaternary age, or Age of man.\\n\\n1. The number four. Boyle. 2. (Geol.)  The Quaternary age, era, or formation. See the Chart of Geology.","quinquagesima":"Fiftieth. Quinquagesima Sunday, the Sunday which is the fiftieth day before Easter, both days being included in the reckoning; -- called also Shrove Sunday.","quantivalence":"Valence. [Archaic]","quichuan":"Designating, or pertaining to, a linguistic stock of South American Indians, including the majority of the civilized tribes of the ancient Peruvian Empire with some wild tribes never subjugated by the Incas. Most of these Indians are short, but heavy and strong. They are brachycephalic and of remarkably low cranial capacity. Nevertheless, they represent one of the highest of native American civilizations, characterized by agricultural, military, and administrative skill rather than by science or literature, although they were adept potters, weavers, and goldsmiths, and preserved by the aid of the mnemonic quipu a body of legendary lore in part written down since the introduction of writing.","quadricapsular":"Having four capsules.","queerly":"In a queer or odd manner.","quantity":"1. The attribute of being so much, and not more or less; the property of being measurable, or capable of increase and decrease, multiplication and division; greatness; and more concretely, that which answers the question \\"How much\\"; measure in regard to bulk or amount; determinate or comparative dimensions; measure; amount; bulk; extent; size. Hence, in specific uses: (a) (Logic) The extent or extension of a general conception, that is, the number of species or individuals to which it may be applied; also, its content or comprehension, that is, the number of its constituent qualities, attributes, or relations. (b) (Gram.) The measure of a syllable; that which determines the time in which it is pronounced; as, the long or short quantity of a vowel or syllable. (c) (Mus.) The relative duration of a tone. 2. That which can be increased, diminished, or measured; especially (Math.), anything to which mathematical processes are applicable. Note: Quantity is discrete when it is applied to separate objects, as in number; continuous, when the parts are connected, either in succession, as in time, motion, etc., or in extension, as by the dimensions of space, viz., length, breadth, and thickness. 3. A determinate or estimated amount; a sum or bulk; a certain portion or part; sometimes, a considerable amount; a large portion, bulk, or sum; as, a medicine taken in quantities, that is, in large quantities. The quantity of extensive and curious information which he had picked up during many months of desultory, but not unprofitable, study. Macaulay. Quantity of estate (Law), its time of continuance, or degree of interest, as in fee, for life, or for years. Wharton (Law Dict. ) -- Quantity of matter, in a body, its mass, as determined by its weight, or by its momentum under a given velocity. -- Quantity of motion (Mech.), in a body, the relative amount of its motion, as measured by its momentum, varying as the product of mass and velocity. -- Known quantities (Math.), quantities whose values are given. -- Unknown quantities (Math.), quantities whose values are sought.","quakingly":"In a quaking manner; fearfully. Sir P. Sidney.","quinch":"To stir; to wince. [Obs.] Spenser.","quindem":"A fifteenth part. [Obs.]","quarreling":"Engaged in a quarrel; apt or disposed to quarrel; as, quarreling factions; a quarreling mood. -- Quar\\"rel*ing*ly, adv.","quadrifurcated":"Having four forks, or branches.","quadrivalence":"The quality or state of being quadrivalent; tetravalence.","querquedule":"(a) A teal. (b) The pintail duck.","quadrigeminal":"Fourfold; having four similar parts, or two pairs of similar parts. Quadrigeminal bodies (Anat.), two pairs of lobes, or elevations, on the dorsal side of the midbrain of most mammals; the optic lobes. The anterior pair are called the nates, and the posterior the testes.","quadruplet":"1. A collection or combination of four of a kind. 2.  pl. Four children born in the same labor. 3.  A cycle for carrying four riders, so arranged that all the reders can assist in the propulsion.","quivered":"1. Furnished with, or carrying, a quiver. \\"Like a quivered nymph with arrows keen.\\" Milton. 2. Sheathed, as in a quiver. \\"Whose quills stand quivered at his ear.\\" Pope.","quagmire":"Soft, wet, miry land, which shakes or yields under the feet. \\"A spot surrounded by quagmires, which rendered it difficult of access.\\" Palfrey. Syn. -- Morass; marsh; bog; swamp; fen; slough.","queintise":"See Quaintise. [Obs.] Chaucer.","quadrisulcate":"Having four hoofs; as, a quadrisulcate foot; a quadrisulcate animal.","qualificator":"An officer whose business it is to examine and prepare causes for trial in the ecclesiastical courts.","quiddany":"A confection of quinces, in consistency between a sirup and marmalade.","quill":"1. One of the large feathers of a bird\'s wing, or one of the rectrices of the tail; also, the stock of such a feather. 2. A pen for writing made by sharpening and splitting the point or nib of the stock of a feather; as, history is the proper subject of his quill. Sir H. Wotton. 3. (Zo\xf6l.) (a) A spine of the hedgehog or porcupine. (b) The pen of a squid. See Pen. 4. (Mus.) (a) The plectrum with which musicians strike the strings of certain instruments. (b) The tube of a musical instrument. He touched the tender stops of various quills. Milton. 5. Something having the form of a quill; as: (a) The fold or plain of a ruff. (b) (Weaving) A spindle, or spool, as of reed or wood, upon which the thread for the woof is wound in a shuttle. (c) (Mach.) A hollow spindle. Quill bit, a bit for boring resembling the half of a reed split lengthways and having its end sharpened like a gouge. -- Quill driver, one who works with a pen; a writer; a clerk. [Jocose] -- Quill nib, a small quill pen made to be used with a holder. Simmonds.\\n\\n1. To plaint in small cylindrical ridges, called quillings; as, to quill a ruffle. His cravat seemed quilled into a ruff. Goldsmith. 2. To wind on a quill, as thread or yarn. Judd.","quincuncially":"In the manner or order of a quincunx.","quarantine":"1. A space of forty days; -- used of Lent. 2. Specifically, the term, originally of forty days, during which a ship arriving in port, and suspected of being infected a malignant contagious disease, is obliged to forbear all intercourse with the shore; hence, such restraint or inhibition of intercourse; also, the place where infected or prohibited vessels are stationed. Note: Quarantine is now applied also to any forced stoppage of travel or communication on account of malignant contagious disease, on land as well as by sea. 3. (Eng. Law)  The period of forty days during which the widow had the privilege of remaining in the mansion house of which her husband died seized. Quarantine flag, a yellow flag hoisted at the fore of a vessel or hung from a building, to give warning of an infectious disease; -- called also the yellow jack, and yellow flag.\\n\\nTo compel to remain at a distance, or in a given place, without intercourse, when suspected of having contagious disease; to put under, or in, quarantine.","queenhood":"The state, personality, or character of a queen; queenliness. Tennyson.","quadrifoliate":"Four-leaved; having the leaves in whorls of four.","quatre":"A card, die. or domino, having four spots, or pips","querl":"To twirl; to turn or wind round; to coil; as, to querl a cord, thread, or rope. [Local, U.S.]\\n\\nA coil; a twirl; as, the qwerl of hair on the fore leg of a blooded horse. [Local, U. S.]","quake":"1. To be agitated with quick, short motions continually repeated; to shake with fear, cold, etc.; to shudder; to tremble. Quaking for dread.\\" Chaucer. She stood quaking like the partridge on which the hawk is ready to seize. Sir P. Sidney. 2. To shake, vibrate, or quiver, either from not being solid, as soft, wet land, or from violent convulsion of any kind; as, the earth quakes; the mountains quake. \\" Over quaking bogs.\\" Macaulay.\\n\\nTo cause to quake. [Obs.] Shak.\\n\\nA tremulous agitation; a quick vibratory movement; a shudder; a quivering.","qualifiedly":"In the way of qualification; with modification or qualification.","quant":"A punting pole with a broad flange near the end to prevent it from sinking into the mud; a setting pole.","quantification":"Modification by a reference to quantity; the introduction of the element of quantity. The quantification of the predicate belongs in part to Sir William Hamilton; viz., in its extension to negative propositions. De Quincey.","quasimodo":"The first Sunday after Easter; Low Sunday.","quixotism":"That form of delusion which leads to extravagant and absurd undertakings or sacrifices in obedience to a morbidly romantic ideal of duty or honor, as illustrated by the exploits of Don Quixote in knight-errantry.","queenliness":"The quality of being queenly; the; characteristic of a queen; stateliness; eminence among women in attractions or power.","quadribasic":"Same as Tetrabasic.","quincunx":"1. An arrangement of things by fives in a square or a rectangle, one being placed at each corner and one in the middle; especially, such an arrangement of trees repeated indefinitely, so as to form a regular group with rows running in various directions. 2. (Astrol.)  The position of planets when distant from each other five signs, or 150\xba. Hutton. 3. (Bot.)  A quincuncial arrangement, as of the parts of a flower in \xe6stivation. See Quincuncial, 2.","quinine":"An alkaloid extracted from the bark of several species of cinchona (esp. Cinchona Calisaya) as a bitter white crystalline substance, C20H24N2O2. Hence, by extension (Med.), any of the salts of this alkaloid, as the acetate, chloride, sulphate, etc., employed as a febrifuge or antiperiodic. Called also quinia, quinina, etc. [Written also chinine.]","quadragene":"An indulgence of forty days, corresponding to the forty days of ancient canonical penance.","quadrisection":"A subdivision into four parts.","quibbler":"One who quibbles; a caviler; also, a punster.","quiritation":"A crying for help. [Obs.] Bp. Hall.","quadrifarious":"Arranged in four rows or ranks; as, quadrifarious leaves. Loudon.","quatorze":"The four aces, kings, queens, knaves, or tens, in the game of piquet; -- so called because quatorze counts as fourteen points.","quadrable":"That may be sqyared, or reduced to an equivalent square; -- said of a surface when the area limited by a curve can be exactly found, and expressed in a finite number of algebraic terms.","quantitively":"So as to be measurable by quantity; quantitatively.","quinoxaline":"Any one of a series of complex nitrogenous bases obtained by the union of certain aniline derivatives with glyoxal or with certain ketones. [Written also chinoxaline.]","quadrennially":"Once in four years.","quatuor":"A quartet; -- applied chiefly to instrumental compositions.","quadripartition":"A division or distribution by four, or into four parts; also, a taking the fourth part of any quantity or number.","queenly":"Like, becoming, or suitable to, a queen.","quire":"See Choir. [Obs.] Spenser. A quire of such enticing birds. Shak.\\n\\nTo sing in concert. [R.] Shak.\\n\\nA collection of twenty-four sheets of paper of the same size and quality, unfolded or having a single fold; one twentieth of a ream.","quillaia bark":"The bark of a rosaceous tree (Quillaja Saponaria), native of Chili. The bark is finely laminated, and very heavy with alkaline substances, and is used commonly by the Chilians instead of soap. Also called soap bark.","quindecone":"An unsaturated hydrocarbon, C15H26, of the valylene series, produced artificially as an oily liquid. [Written also quindekone.]","quinic":"Pertaining to, derived from, or connected with, quinine and related compounds; specifically, designating a nonnitrogenous acid obtained from cinchona bark, coffee, beans, etc., as a white crystalline substance. [Written also chinic, kinic.]","quench":"1. To extinguish; to overwhelm; to make an end of; -- said of flame and fire, of things burning, and figuratively of sensations and emotions; as, to quench flame; to quench a candle; to quench thirst, love, hate, etc. Ere our blood shall quench that fire. Shak. The supposition of the lady\'s death Will quench the wonder of her infamy. Shak. 2. To cool suddenly, as heated steel, in tempering. Syn. -- To extinguish; still; stifle; allay; cool; check.\\n\\nTo become extinguished; to go out; to become calm or cool. [R.] Dost thou think in time She will not quench! Shak.","quartan":"Of or pertaining to the fourth; occurring every fourth day, reckoning inclusively; as, a quartan ague, or fever.\\n\\n1. (Med.)  An intermittent fever which returns every fourth day, reckoning inclusively, that is, one in which the interval between paroxysms is two days. 2. A measure, the fourth part of some other measure.","quahog":"An American market clam (Venus mercenaria). It is sold in large quantities, and is highly valued as food. Called also round clam, and hard clam. Note: The name is also applied to other allied species, as Venus Mortoni of the Gulf of Mexico.","quib":"A quip; a gibe.","quirky":"Full of quirks; tricky; as, a quirky lawyer.","quittable":"Capable of being quitted.","quodlibet":"1. A nice point; a subtilty; a debatable point. These are your quodlibets, but no learning. P. Fletcher. 2. (Mus.)  A medley improvised by several performers.","quoddies":"Herring taken and cured or smoked near Quoddy Head, Maine, or near the entrance of Passamaquoddy Ray.","quickens":"Quitch grass.","quirl":"See Querl.","quandong":"The edible drupaceous fruit of an Australian tree (Fusanus acuminatus) of the Sandalwood family; -- called also quandang.","qua-bird":"The American night heron. See under Night.","queen olive":"Properly, a kind of superior olive grown in the region of Seville, Spain. It is large size and oblong shape with a small but long pit; it is cured when green, keeps well, and has a delicate flavor. Loosely, any olive of similar character.","quotha":"Indeed; forsooth. To affront the blessed hillside drabs and thieves With mended morals, quotha, -- fine new lives ! Mrs. Browning.","quadrinominal":"Quadrinomial. Sir W. R. Hamilton.","quincuncial":"1. Having the form of a quincunx. 2. (Bot.)  Having the leaves of a pentamerous calyx or corolla so imbricated that two are exterior, two are interior, and the other has one edge exterior and one interior; as, quincuncial \xe6stivation. Quincuncial phyllotaxy (Bot.), an arrangement of five leaves in a spiral, each leaf two fifths of a circle from the next.","quipo":"Same as Quipu.","quartzite":"Massive quartz occurring as a rock; a metamorphosed sandstone; -- called also quartz rock.","quittal":"Return; requital; quittance. [Obs.]","quietist":"One of a sect of mystics originated in the seventeenth century by Molinos, a Spanish priest living in Rome. See Quietism.","quadrennium":"A space or period of four years.","quash":"Same as Squash.\\n\\nTo abate, annul, overthrow, or make void; as, to quash an indictment. Blackstone.\\n\\n1. To beat down, or beat in pieces; to dash forcibly; to crush. The whales Against sharp rocks, like reeling vessels, quashed, Though huge as mountains, are in pieces dashed. Waller. 2. To crush; to subdue; to suppress or extinguish summarily and completely; as, to quash a rebellion. Contrition is apt to quash or allay all worldly grief. Barrow.\\n\\nTo be shaken, or dashed about, with noise.","quintet":"A composition for five voices or instruments; also, the set of five persons who sing or play five-part music.","quaint":"1. Prudent; wise; hence, crafty; artful; wily. [Obs.] Clerks be full subtle and full quaint. Chaucer. 2. Characterized by ingenuity or art; finely fashioned; skillfully wrought; elegant; graceful; nice; neat. [Archaic] \\" The queynte ring.\\" \\" His queynte spear.\\" Chaucer. \\" A shepherd young quaint.\\" Chapman. Every look was coy and wondrous quaint. Spenser. To show bow quaint an orator you are. Shak. 3. Curious and fanciful; affected; odd; whimsical; antique; archaic; singular; unusual; as, quaint architecture; a quaint expression. Some stroke of quaint yet simple pleasantry. Macaulay. An old, long-faced, long-bodied servant in quaint livery. W. Irving. Syn. -- Quaint, Odd, Antique. Antique is applied to that which has come down from the ancients, or which is made to imitate some ancient work of art. Odd implies disharmony, incongruity, or unevenness. An odd thing or person is an exception to general rules of calculation and procedure, or expectation and common experience. In the current use of quaint, the two ideas of odd and antique are combined, and the word is commonly applied to that which is pleasing by reason of both these qualities. Thus, we speak of the quaint architecture of many old buildings in London; or a quaint expression, uniting at once the antique and the fanciful.","quadrijugous":"Pinnate, with four pairs of leaflets; as, a quadrijugous leaf.","quadragesima":"The forty days of fast preceding Easter; Lent. Quadragesima Sunday, the first Sunday in Lent, about forty days before Easter.","quickset":"A living plant set to grow, esp. when set for a hedge; specifically, the hawthorn.\\n\\nMade of quickset. Dates and pomegranates on the quickset hedges. Walpole.\\n\\nTo plant with living shrubs or trees for a hedge; as, to quickset a ditch. Mortimer.","quemeful":"Kindly; merciful. [Obs.] Wyclif.","quillwort":"Any plant or species of the genus Isoetes, cryptogamous plants with a cluster of elongated four-tubed rushlike leaves, rising from a corm, and containing spores in their enlarged and excavated bases. There are about seventeen American species, usually growing in the mud under still, shallow water. So called from the shape of the shape of the leaves.","quebrith":"Sulphur. [Obs.]","quaking":"a. & n. from Quake, v. Quaking aspen (Bot.), an American species of poplar (Populus tremuloides), the leaves of which tremble in the lightest breeze. It much resembles the European aspen. See Aspen. -- Quaking bog, a bog of forming peat so saturated with water that it shakes when trodden upon. -- Quaking grass. (Bot.) (a) One of several grasses of the genus Briza, having slender-stalked and pendulous ovate spikelets, which quake and rattle in the wind. Briza maxima is the large quaking grass; B. media and B. minor are the smaller kinds. (b) Rattlesnake grass (Glyceria Canadensis).","quintel":"See Quintain.","quickly":"Speedily; with haste or celerity; soon; without delay; quick.","quad":"Evil; bad; baffling; as, a quade wind. [Obs.] Sooth play, quad play, as the Fleming saith. Chaucer.\\n\\nA quadrat.\\n\\nA quadrangle; hence, a prison. [Cant or Slang]","quadriliteral":"Consisting of four letters.","quintuplet":"1. A collection or combination of five of a kind. 2.  pl. Five children born in the same labor. 3.  (Mus.) A group of five connected notes; a turn of five notes. 4.  A cycle having five crank shafts and adapted for five riders, all of whom can assist in the propulsion.","quintessence":"1. The fifth or last and highest essence or power in a natural body. See Ferment oils, under Ferment. [Obs.] Note: The ancient Greeks recognized four elements, fire, air, water, and earth. The Pythagoreans added a fifth and called it nether, the fifth essence, which they said flew upward at creation and out of it the stars were made. The alchemists sometimes considered alcohol, or the ferment oils, as the fifth essence. 2. Hence: An extract from anything, containing its rarest virtue, or most subtle and essential constituent in a small quantity; pure or concentrated essence. Let there be light, said God; and forthwith light Ethereal, first of things, quintessence pure, Sprung from the deep. Milton.\\n\\nTo distil or extract as a quintessence; to reduce to a quintessence. [R.] Stirling. \\"Truth quintessenced and raised to the highest power.\\" J. A. Symonds.","quap":"To quaver. [Obs.] See Quob.","quadrisyllable":"A word consisting of four syllables. De Quincey.","questionability":"The state or condition of being questionable. Stallo.","quadrumana":"A division of the Primates comprising the apes and monkeys; -- so called because the hind foot is usually prehensile, and the great toe opposable somewhat like a thumb. Formerly the Quadrumana were considered an order distinct from the Bimana, which last included man alone.","quiescency":"The state or quality of being quiescent. \\"Quiescence, bodily and mental.\\" H. Spencer. Deeds will be done; -- while be boasts his quiescence. R. Browning.","quegh":"A drinking vessel. See Quaich.","quibblingly":"Triflingly; evasively.","quinsy":"An inflammation of the throat, or parts adjacent, especially of the fauces or tonsils, attended by considerable swelling, painful and impeded deglutition, and accompanied by inflammatory fever. It sometimes creates danger of suffocation; -- called also squinancy, and squinzey.","quintuple-ribbed":"The same as Quinquenerved.","quintuple-nerved":"The same as Quinquenerved.","quirt":"A rawhide whip plaited with two thongs of buffalo hide T. Roosevelt.","queensland nut":"The nut of an Australian tree (Macadamia ternifolia). It is about an inch in diameter, and contains a single round edible seed, or sometimes two hemispherical seeds. So called from Queensland in Australia.","queach":"A thick, bushy plot; a thicket. [Obs.] Chapman.\\n\\nTo stir; to move. See Quick, v. i. [Obs.]","quixotic":"Like Don Quixote; romantic to extravagance; absurdly chivalric; apt to be deluded. \\"Feats of quixotic gallantry.\\" Prescott.","quich":"To stir. [Obs.] He could not move nor quich at all. Spenser.","quoin":"1. (Arch.)  Originally, a solid exterior angle, as of a building; now, commonly, one of the selected pieces of material by which the corner is marked. Note: In stone, the quoins consist of blocks larger than those used in the rest of the building, and cut to dimension. In brickwork, quoins consist of groups or masses of brick laid together, and in a certain imitation of quoins of stone. 2. A wedgelike piece of stone, wood metal, or other material, used for various purposes, as: (a) (Masonry)  to support and steady a stone. (b) (Gun.) To support the breech of a cannon. (c) (Print.) To wedge or lock up a form within a chase. (d) (Naut.) To prevent casks from rolling. Hollow quoin. See under Hollow. -- Quoin post (Canals), the post of a lock gate which abuts against the wall.","quiz":"1. A riddle or obscure question; an enigma; a ridiculous hoax. 2. One who quizzes others; as, he is a great quiz. 3. An odd or absurd fellow. Smart. Thackeray. 4. An exercise, or a course of exercises, conducted as a coaching or as an examination. [Cant, U.S.]\\n\\n1. To puzzle; to banter; to chaff or mock with pretended seriousness of discourse; to make sport of, as by obscure questions. He quizzed unmercifully all the men in the room. Thackeray. 2. To peer at; to eye suspiciously or mockingly. 3. To instruct in or by a quiz. See Quiz, n., 4. [U.S.] Quizzing glass, a small eyeglass.\\n\\nTo conduct a quiz. See Quiz, n., 4. [U.S.]","quenchable":"Capable of being quenched.","quarter round":"An ovolo.","quadrivalvular":"Having four valves; quadrivalve.","quook":"imp. of Quake. [Obs.] Spenser.","qualifier":", One who, or that which, qualifies; that which modifies, reduces, tempers or restrains.","quilling":"(a) A band of linen, muslin, or the like, fluted, folded, or plaited so as somewhat to resemble a row of quills. (b) One of the rounded plaits or flutings of such a band.","queen-post":"One of two suspending posts in a roof truss, or other framed truss of similar form. See King-post.","queening":"Any one of several kinds of apples, as summer queening, scarlet queening, and early queening. An apple called the queening was cultivated in England two hundred years ago.","questor":"An officer who had the management of the public treasure; a receiver of taxes, tribute, etc.; treasurer of state. [Written also qu\xe6stor.] Note: At an early period there were also public accusers styled questors, but the office was soon abolished.","quiddle":"To spend time in trifling employments, or to attend to useful subjects in an indifferent or superficial manner; to dawdle.\\n\\nOne who wastes his energy about trifles. Emerson."}')}}]);
